\":0},{\"message\":\"Hola Ivette, gracias por responder y tu disponibilidad para asesorarme. Si est\\u00e1s de acuerdo podemos vernos el viernes 7 de abril a partir de las 5 p.m., en el lugar donde t\\u00fa elijas y el m\\u00e1s conveniente al interior de la nacho, me comentas con tiempo; gracias, un abrazo.\",\"date\":\"2017-03-30\",\"time\":\"23:23:03\",\"sender\":460,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-03\",\"time\":\"20:17:14\",\"sender\":439,\"state\":5,\"deal\":67,\"dealState\":4},{\"message\":\"Yo estoy en el edificio 212, Aulas de Humanas, oficina 411, ac\\u00e1 puede ser para tener como charlar!! \",\"date\":\"2017-04-03\",\"time\":\"20:18:04\",\"sender\":439,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Gracias Ivette por t\\u00fa respuesta, como la nacho cierra su edificios los viernes antes de las 4:00 p.m., \\u00bfpodr\\u00eda ser nuestro encuentro minutos antes de esa hora?\",\"date\":\"2017-04-04\",\"time\":\"09:25:46\",\"sender\":460,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-04\",\"time\":\"09:25:50\",\"sender\":460,\"state\":5,\"deal\":\"67\",\"dealState\":7},{\"message\":\"Si, puede ser, mi Wp es 318 406 9127, cualquier cosa yo estoy pendiente. \",\"date\":\"2017-04-04\",\"time\":\"22:26:14\",\"sender\":439,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-24 05:25:01','2017-04-06 08:10:08'),(65,183,461,'[{\"message\":\"Hola! Mi nombre es Nicolas, estoy interesado en aprender sobre el manejo de excel.\\r\\n\",\"date\":\"2017-03-24\",\"time\":\"01:12:29\",\"sender\":461,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Nicolas, que nivel de excel necesitas y cual es tu disponibilidad de horario.\",\"date\":\"2017-03-26\",\"time\":\"23:54:19\",\"sender\":327,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Basico, despu\\u00e9s de las 8 de la noche cualquier d\\u00eda. Es virtual? \",\"date\":\"2017-0