dimiento. En estos 7 meses te puedo compartir lo que he aprendido, principalmente en lo referente a aprendizajes propios + idear, aterrizar y probar modelos de negocios.\",\"date\":\"2017-03-27\",\"time\":\"14:20:54\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Sobre alimentaci\\u00f3n fit, los temas en que deseo asesor\\u00eda es en par\\u00e1metros importantes para definir tiempos, porciones y alimentos para apoyar objetivos fit como: subir masa muscular, reducir grasa corporal, subir de peso, bajar de peso ... \\u00bfC\\u00f3mo andas de tiempos? A\\u00fan no tengo claro como funcionan las ofertas en esta plataforma.\",\"date\":\"2017-03-27\",\"time\":\"14:26:01\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Podr\\u00eda reunirme contigo un viernes de 9 a 11 de la ma\\u00f1ana, tu que horarios tienes disponibles?\",\"date\":\"2017-04-01\",\"time\":\"15:23:35\",\"sender\":248,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola, el viernes de 9 a 11 me queda bien. Precisamente este viernes tengo programado trabajar desde la hemeroteca. \\u00bfTe suena este viernes?\",\"date\":\"2017-04-03\",\"time\":\"14:47:51\",\"sender\":380,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-03-24 21:34:51','2017-04-03 19:47:51'),(89,297,59,'[{\"message\":\"Hola! c\\u00f3mo est\\u00e1s? me interesa mucho aprender pero nunca hab\\u00eda sabido d\\u00f3nde. Tengo tiempo en las tardes, cu\\u00e1ndo puedes?\",\"date\":\"2017-03-24\",\"time\":\"19:13:57\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola, te parece bien los mi\\u00e9rcoles? Tengo espacio de doce a cuatro\",\"date\":\"2017-03-26\",\"time\":\"12:46:22\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"podr\\u00eda los mi\\u00e9rcoles 2-4 pero no este mi\\u00e9rcoles, el jueves estoy libre desde las 11. \\u00bfEn qu\\u00e9 lugar te queda bien para encontrarnos?\",\"date\":\"2017-03-26\",\"time\":\"18:01:15\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"El jueves tengo clase todo el d\\u00eda, ser\\u00eda el mi\\u00e9rcoles de la otra semana. Creo que en posgrados de ciencias humanas esta bien para no mojarnos. Quer\\u00eda preguntarte si quieres hacerlo de una hora o dos\",\"date\":\"2017-03-27\",\"time\":\"23:23:42\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Tambi\\u00e9n puedo los lunes despu\\u00e9s de la una o los martes de doce a cuatro, pero ma\\u00f1ana no.\",\"date\":\"2017-03-27\",\"time\":\"23:25:45\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"qu\\u00e9 te parece el lunes a las 3? por ahora ser\\u00eda 1 hora, te doy mi tel\\u00e9fono?\",\"date\":\"2017-03-27\",\"time\":\"23:41:45\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"S\\u00ed, listo. mi n\\u00famero es 3132834141.\",\"date\":\"2017-03-28\",\"time\":\"18:24:28\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"El m\\u00edo es 3152452138 \",\"date\":\"2017-03-29\",\"time\":\"10:50:39\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Olvid\\u00e9 preguntarte, \\u00bfhay algo que quieras saber en particular ?  \\u00bfempezamos desde el abecedario?\",\"date\":\"2017-03-30\",\"time\":\"00:23:06\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"lo dejo a tu criterio\",\"date\":\"2017-03-30\",\"time\":\"16:57:09\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-03-31\",\"time\":\"01:54:42\",\"sender\":499,\"state\":5,\"deal\":61,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-03-31\",\"time\":\"17:24:24\",\"sender\":59,\"state\":5,\"deal\":\"61\",\"dealState\":7}]','2017-03-25 00:13:57','2017-04-02 00:21:40'),(90,212,143,'[{\"message\":\"Hola Valentina como estas, soy Andres Diaz, quisiera saber si conoces la t\\u00e9cnica de pintura con acuarela o los principios, me