dar, frases basicas, como para poder entablar una conversacion muy basica con discapacidad auditiva. considero que podemos empezar con una hora y ver como nos va. te queda facil en la universidad nacional ?\",\"date\":\"2017-04-03\",\"time\":\"03:36:21\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"S\\u00ed, perfecto\",\"date\":\"2017-04-03\",\"time\":\"13:33:42\",\"sender\":499,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-25 01:33:44','2017-04-03 22:25:26'),(94,289,143,'[{\"message\":\"Hola Jorge como estas, soy Andres Diaz, quisiera recibir algunas clases de solid works por favor!!, tengo el programa y aun no le he instalado datos de contacto anmdiazpe@unal.edu.co - 317 374 6498, tambien ofrezco cursos aqu\\u00ed para intercambio !\",\"date\":\"2017-03-24\",\"time\":\"20:36:34\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Andr\\u00e9s como vas?, claro que puedo ayudarte, primero que todo, quisiera saber si te es en estos momentos factible la instalaci\\u00f3n del programa, que versi\\u00f3n de Solid vas a manejar y que nociones de dibujo o de dise\\u00f1o tienes y luego prcedemos.\",\"date\":\"2017-03-24\",\"time\":\"21:35:42\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Andr\\u00e9s como vas?, claro que puedo ayudarte, primero que todo, quisiera saber si te es en estos momentos factible la instalaci\\u00f3n del programa, que versi\\u00f3n de Solid vas a manejar y que nociones de dibujo o de dise\\u00f1o tienes y luego prcedemos.\",\"date\":\"2017-03-24\",\"time\":\"21:35:42\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"que pena tuve un error de copie pegue.\",\"date\":\"2017-03-24\",\"time\":\"21:36:12\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"que pena tuve un error de copie pegue.\",\"date\":\"2017-03-24\",\"time\":\"21:36:12\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Jorge, no hay problema. Aun no he instalado el programa por que no se si hay par\\u00e1metros en especial que deban cumplirse para hacerlo, hasta donde se tengo la ultima versi\\u00f3n del solid, me interesa mucho la parte de simulaci\\u00f3n t\\u00e9rmica y donde lo compre me dice que trae ese componente, aun asi quisiera tambi\\u00e9n aprender las nociones b\\u00e1sicas, yo estudio en la universidad nacional actualmente, te agradeceria enormemente si me puedes ayudar desde el proceso de instalaci\\u00f3n y si podemos hacer varias sesiones, como te dec\\u00eda tambi\\u00e9n ofrezco algunos cursos y para mi es un gusto poder ayudar si estas interesado en algo. cordial saludo!\",\"date\":\"2017-03-25\",\"time\":\"00:59:05\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Te notifico que lastimosamente no he usado simulaciones en las versiones que he usado, por otro lado para este entonces uso SW 2012 la cual ya tiene su tiempo. Podria ayudarte con lo de las nociones, y a lograr las piezas q quieras, desde un pi\\u00f1on, piezas industriales, desarrollo de productos y moldes de inyecci\\u00f3n. Lo que me dices entonces es que tenes el programa, pero posees el serial?, ya eso lo hace mas facil.\",\"date\":\"2017-03-25\",\"time\":\"05:12:57\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Por lo pronto quisiera saber que estudias y que conoces de vistas ortogonales? Has manejado antes un programa CAD?\",\"date\":\"2017-03-25\",\"time\":\"05:15:21\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"muchas gracias Jorge, me interesa mucho sobre las piezas que nombras. SI! ya cuento con el programa, tengo los DVD\'s por si te interesan tambien, soy ingeniero mecanico y en algun momento use el programa y trabaje sobre las vistas ortogonales y las vistas de planos solo que mi linea de trabajo es otra y deje de usarlo pero quiero retomarlo de nuevo!\",\"date\":\"2017-03-25\",\"time\":\"17:20:58\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"En ese caso empezamos cuando desees, cu\\u00e9ntame con que tiempo dispones y de acuerdo a ello iniciamos las clases, teniendo ya una noci\\u00f3n todo es mas f\\u00e1cil.\",\"date\":\"2017-03-27\",\"time\":\"13:11:32\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Jorge, gracias por tu amabilidad, tengo libre todas las tardes y estoy en la universidad todos los d\\u00edas. a la hora y fecha que me digas esta bien, cordial saludo! \",\"date\":\"2017-03-27\",\"time\":\"22:17:52\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"tienes tal vez hangoust? asi podremos hacer sesiones via web\",\"date\":\"2017-03-29\",\"time\":\"01:23:32\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"si cuento con hangouts, quer\\u00eda  pedirte el favor tambien sobre asesoria para instalar el programa si no es mucha molestia. saludos !\",\"date\":\"2017-03-29\",\"time\":\"22:59:31\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Excelente, te parece si comenzamos el s\\u00e1bado? y cont\\u00e1me que problemas tenes con el programa, no lo he instalado antes porque una amiga hace eso por mi, pero puedo preguntarle respecto al inconveniente que tengas.\",\"date\":\"2017-03-30\",\"time\":\"13:14:46\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Jorge, hasta ahora puedo conectarme nuevamente,  el sabado estuve en una salida de campo y hasta hoy vuelvo a tener un PC en la mano, entiendo lo de la instalaci\\u00f3n del porgrama, pues me gustaria saber si hay recomendaciones en especial para la instalacion de este en la version 2016. cordial saludo!\",\"date\":\"2017-04-03\",\"time\":\"03:38:57\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buenos d\\u00edas Andres, te puedo decir que no hay restricci\\u00f3n o adecuaci\\u00f3n alguna en la instalaci\\u00f3n el software, al menos en mi experiencia, la instalaci\\u00f3n como el manejo del programa es muy intuitiva y te guiar\\u00e1 efectivamente a trav\\u00e9s del proceso, sin embargo, si tenes una duda mas puntual podes comunic\\u00e1rmela.\",\"date\":\"2017-04-03\",\"time\":\"14:06:12\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Jorge, Muchas gracias por el acompa\\u00f1amiento y la paciencia en este proceso, me encargare de la instalaci\\u00f3n del software y te volver\\u00e9 a molestar de nuevo cuando tenga todo listo para empezar, cordial saludo !\",\"date\":\"2017-04-04\",\"time\":\"23:09:10\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"No como se te ocurre, no me molesta para nada, estoy para ayudarte a vos. Sucede que como tal no soy una persona con un titulo en SW, sino alguien que utiliza y conoce muy bien el software hace mas de 3 a\\u00f1os, por ello te notifico que muy complacidamente te voy a colaborar en tu proceso; y lo otro es, que el software me lo han instalado, algo que no he hecho o no he podido hacer por  mi cuenta porque el  que tengo actualmente ha estado siempre vigente, ademas su forma de instalaci\\u00f3n consta de pasos sencillos a seguir. Igualmente Andr\\u00e9s no dudes en preguntarme o dirigirte que de la manera mas cel\\u00e9rica posible acudir\\u00e9 a tus preguntas.\",\"date\":\"2017-04-05\",\"time\":\"13:00:02\",\"sender\":491,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-25 01:36:34','2017-04-11 04:39:00'),(95,248,513,'[{\"message\":\"Hola Nathalia, me gustar\\u00eda tomar una clase contigo de ingles informal, podr\\u00eda  en la UN o hacia el norte de la ciudad, estar\\u00eda bien? \",\"date\":\"2017-03-24\",\"time\":\"22:40:03\",\"sender\":513,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"hola, en la u esta bien, puedo el mi\\u00e9rcoles despu\\u00e9s de las 4 o el jueves antes de las 11\",\"date\":\"2017-03-25\",\"time\":\"00:14:07\",\"sender\":435,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"El mi\