u00eda. Me parece interesante su visi\\u00f3n de los jardines verticales especialmente en el tema de materiales y dise\\u00f1os. En que consiste su propuesta? gracias\",\"date\":\"2017-03-24\",\"time\":\"23:44:56\",\"sender\":275,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buenas noches! mi propuesta es concretamente dar una introducci\\u00f3n al tema ya que a\\u00fan muchas personas no lo conocen, en la primer hora ser\\u00eda dar las generalidades y comenzar a concretar qu\\u00e9 desea realizar la persona, ir llegando de a poco a un dise\\u00f1o, para la segunda sesi\\u00f3n lo ideal ser\\u00eda comenzar a armar un peque\\u00f1o m\\u00f3dulo para ense\\u00f1ar los pormenores en la pr\\u00e1ctica, si la  persona desea puede seguir con m\\u00e1s acompa\\u00f1amiento o seguir solo desde ese punto\",\"date\":\"2017-03-25\",\"time\":\"03:10:17\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Por supuesto, no soy un gur\\u00fa del tema, si existe la opci\\u00f3n de intercambiar saberes sobre el tema ser\\u00eda genial\",\"date\":\"2017-03-25\",\"time\":\"03:15:42\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Me parece interesante como lo enfoca el tema estar\\u00eda gustoso en compartir tambi\\u00e9n lo poco que sepa del tema, pero como no estoy habituado con esta p\\u00e1gina, tengo unas dudas: en que momento puede dar la lecci\\u00f3n? que pide a cambio? con cuanta gente se comparte?. Gracias!\",\"date\":\"2017-03-25\",\"time\":\"15:25:03\",\"sender\":275,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"No se preocupe, tambi\\u00e9n soy nuevo, la p\\u00e1gina lleva una semana. La idea es por este chat acordar la hora y lugar, cualquier intercambio realizado por este medio se realiza en tiempo, al dar un servicio se tiene derecho a recibir el mismo tiempo de otro servicio ofertado. Hay otra persona interesada pero no me ha respondido los mensajes para acordar la cita.\",\"date\":\"2017-03-26\",\"time\":\"17:54:00\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00bfQu\\u00e9 le parece si nos vemos ma\\u00f1ana a las 2pm en la perola, en la universidad nacional?\",\"date\":\"2017-03-26\",\"time\":\"17:54:54\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Leonardo saludos! ... gracias por la prontitud. Acabo de ver el mensaje pero me encuentro sobre la hora as\\u00ed que no alcanzar\\u00eda a llegarle. Normalmente tengo tiempo aunque esta semana particularmente estar\\u00e9 un poco ocupado. En que horarios puede para confirmarle? Gracias\",\"date\":\"2017-03-27\",\"time\":\"16:17:40\",\"sender\":275,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Esta semana tambi\\u00e9n estoy ocupado, podr\\u00edamos cuadrar para el lunes de la pr\\u00f3xima semana en la tarde\",\"date\":\"2017-03-27\",\"time\":\"23:06:55\",\"sender\":59,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"Luis, buenas noches, qu\\u00e9 pena la tardanza en responder. Hay otras personas interesadas y estoy intentando cuadrar para este viernes en la tarde hacer una sesi\\u00f3n todos y as\\u00ed nos rendir\\u00e1 m\\u00e1s el tiempo y disminuir\\u00e1n los costos\",\"date\":\"2017-04-04\",\"time\":\"02:08:15\",\"sender\":59,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-09\",\"time\":\"23:05:19\",\"sender\":59,\"state\":6,\"deal\":76,\"dealState\":4},{\"message\":\"Propuesta Cancelada\",\"date\":\"23:06:00\",\"time\":\"23:06:00\",\"sender\":275,\"state\":5,\"deal\":\"76\",\"dealState\":8}]','2017-03-25 04:44:56','2017-04-18 16:45:55'),(101,71,275,'[{\"message\":\"Hola, me llamo Luis Fernando y soy Ing agr\\u00f3nomo. Para una idea muy particular me gustar\\u00eda tener nociones de ceramica. En que consiste tu propuesta? que pides a cambio? gracias\",\"date\":\"2017-03-24\",\"time\":\"23:54:03\",\"sender\":275,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola, la idea es compa