"time\":\"03:01:31\",\"sender\":361,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"All\\u00ed estar\\u00e9 :)\",\"date\":\"2017-04-03\",\"time\":\"03:20:53\",\"sender\":525,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Fue una experiencia muy enriquecedora, hubo mucha disponibilidad y una preparaci\\u00f3n adecuada del taller  lo cual permiti\\u00f3 que se desarrollara tranquila y alegremente. Fue una maravillosa experiencia \",\"date\":\"2017-04-05\",\"time\":\"15:19:44\",\"sender\":525,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Ahora no me deja hacer la transferencia del dorado, qu\\u00e9 debo hacer?\",\"date\":\"2017-04-05\",\"time\":\"15:20:53\",\"sender\":525,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"No te preocupes, tal vez  se resuelva m\\u00e1s adelante. y entendamos c\\u00f3mo funciona. \",\"date\":\"2017-04-08\",\"time\":\"14:12:11\",\"sender\":361,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Escrib\\u00ed al correo de vivelab para saber c\\u00f3mo se hace la trasferencia de Dorados, pero no respondieron.\",\"date\":\"2017-04-08\",\"time\":\"14:13:01\",\"sender\":361,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-26 09:57:52','2017-04-09 20:23:59'),(129,150,277,'[{\"message\":\"hola mar\\u00eda, me interesa tu clase, espero conocer un poco sobre el lenguaje pero no se si deba llevar algo, podriamos vernos en cualquier lugar del campus los martes o los jueves despu\\u00e9s de la 1\",\"date\":\"2017-03-26\",\"time\":\"14:05:14\",\"sender\":277,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-03-26 19:05:14','2017-03-26 19:05:14'),(130,315,556,'[{\"message\":\"Hola Ana me llamo Gabriela, estoy interesada en tu oferta, me gusta el origami, quiero aprender y compartir con alguien,quiero aprender figuras basicas como la grulla, puedo en el horario que ofreces \\u00bfel lunes 3 de Abril puedes? \",\"date\":\"2017-03-26\",\"time\":\"15:48:48\",\"sender\":556,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-2