te\":5,\"deal\":0,\"dealState\":0}]','2017-03-26 21:03:06','2017-04-04 22:05:00'),(133,172,298,'[{\"message\":\"Hola Jos\\u00e9, me interesa bastante aprender, cuando tienes el espacio para ello \\ud83d\\ude4b\",\"date\":\"2017-03-26\",\"time\":\"16:36:26\",\"sender\":298,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Qu\\u00e9 tal, Bryan? Tengo tiempo en las tardes, despu\\u00e9s de la 1 p.m.\",\"date\":\"2017-03-27\",\"time\":\"14:50:28\",\"sender\":314,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"esta semana podr\\u00eda ser mi\\u00e9rcoles o jueves\",\"date\":\"2017-03-27\",\"time\":\"14:50:48\",\"sender\":314,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00bfQu\\u00e9 tal el mi\\u00e9rcoles?, \\u00bfDonde nos ver\\u00edamos? \",\"date\":\"2017-03-27\",\"time\":\"14:56:35\",\"sender\":298,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00bfQu\\u00e9 tal el mi\\u00e9rcoles?, \\u00bfDonde nos ver\\u00edamos? \",\"date\":\"2017-03-27\",\"time\":\"14:56:37\",\"sender\":298,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-03-27\",\"time\":\"15:31:20\",\"sender\":314,\"state\":5,\"deal\":40,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-03-27\",\"time\":\"15:32:37\",\"sender\":298,\"state\":6,\"deal\":\"40\",\"dealState\":7},{\"message\":\"reg\\u00e1lame por fa un mensaje por whatsapp para tener tu n\\u00famero!\",\"date\":\"2017-03-27\",\"time\":\"15:48:42\",\"sender\":314,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"318 582 55 35\",\"date\":\"2017-03-27\",\"time\":\"15:48:48\",\"sender\":314,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-26 21:36:26','2017-03-27 20:49:35'),(134,217,505,'[{\"message\":\"Flor, a mi mam\\u00e1 le puede interesar esto. \\u00bfcree posible darle lecciones de canto a una persona de 72 a\\u00f1os, con buen sentido musical y mucha voluntad pero que no aprendi\\u00f3 a leer notas? \\u00bfhay coros donde alguien