tate\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola. Pues bueno, creo que no entiendo mucho qu\\u00e9 quieres que haga con la llamada. Aunque, despu\\u00e9s de todo, creo que puede ser una buena idea si lo que ella necesita es contarle a alguien sus intereses musicales. Yo tambi\\u00e9n soy soci\\u00f3loga egresada de la Nacional. Yo puedo los fines de semana, el s\\u00e1bado en la ma\\u00f1ana est\\u00e1 bien. Saludos.\",\"date\":\"2017-04-13\",\"time\":\"14:39:21\",\"sender\":381,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Eso. \",\"date\":\"2017-04-14\",\"time\":\"12:31:57\",\"sender\":505,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"* ella le cuenta a usted de sus intereses musicales, \",\"date\":\"2017-04-14\",\"time\":\"12:32:13\",\"sender\":505,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"* ella seguro le preguntar\\u00e1 qu\\u00e9 se puede esperar de  un coro y de clases de canto; usted le contar\\u00eda qu\\u00e9 se puede hacer. Etc.   Ella de veras tiene mucho sentido musical natural, y creo que disfrutar\\u00eda mucho una pr\\u00e1ctica sistem\\u00e1tica. \",\"date\":\"2017-04-14\",\"time\":\"12:36:58\",\"sender\":505,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"Flor, le pago ahora? no estoy seguro de c\\u00f3mo hacerlo. Unos minutos por favor.\",\"date\":\"2017-04-14\",\"time\":\"12:38:19\",\"sender\":505,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"Ah, como usted ofrece el servicio, creo que le aparece un bot\\u00f3n verde de lado suyo, \\\"proponer acuerdo\\\" o algo as\\u00ed. \",\"date\":\"2017-04-14\",\"time\":\"12:40:55\",\"sender\":505,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-03-27 04:07:11','2017-04-14 17:40:55'),(135,80,336,'[{\"message\":\"Hola.\\r\\n\\r\\nMi nombre es Camilo G\\u00f3mez, egresado de la UN. Actualmente me encuentro trabajando en un emprendimiento y ando en una etapa en que ser\\u00eda muy util hacer una lluv\\u00eda de ideas. \\r\\n\\r\\nMe gustar\\u00eda verme cont