teriales y otras consideraciones; ya para una segunda sesi\\u00f3n se realizar\\u00eda la parte pr\\u00e1ctica. Quedo atento\",\"date\":\"2017-03-27\",\"time\":\"23:05:11\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Leonardo super !\\\"! Pues puedo los jueves y viernes despu\\u00e9s de las 2 entonces no se si te parece bien la otra semana a esta hora, tambi\\u00e9n pongo a tu consideraci\\u00f3n en hacerlo entre todos. \",\"date\":\"2017-03-28\",\"time\":\"18:16:32\",\"sender\":21,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Juan, qu\\u00e9 pena la demora en responder. Lo de hacerlo todos juntos es una idea genial, aparte de compartir experiencias nos rinde m\\u00e1s y los costos disminuyen. Estoy contactando a los dem\\u00e1s interesados para vernos este o el pr\\u00f3ximo viernes en la tarde\",\"date\":\"2017-04-04\",\"time\":\"02:05:49\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Super Leonardo me parece bien. Qued\\u00f3 atento. \",\"date\":\"2017-04-05\",\"time\":\"13:36:38\",\"sender\":21,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-09\",\"time\":\"23:03:08\",\"sender\":59,\"state\":5,\"deal\":74,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-10\",\"time\":\"14:48:16\",\"sender\":21,\"state\":5,\"deal\":\"74\",\"dealState\":7},{\"message\":\"Vale Leonardo perfecto as\\u00ec quedamos. \",\"date\":\"2017-04-10\",\"time\":\"14:48:48\",\"sender\":21,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-28 03:43:13','2017-04-11 05:29:28'),(164,173,21,'[{\"message\":\"Hola Alejandro c\\u00f3mo va todo? Me gustar\\u00eda tomar una hora de  zancos contigo. No s\\u00e9 si puedes el d\\u00eda Viernes o Jueves en la tarde dentro de la Universidad y que debo de tener para la sesi\\u00f3n?\",\"date\":\"2017-03-27\",\"time\":\"22:55:53\",\"sender\":21,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola juan David, discul