mana de receso que viene.\",\"date\":\"2017-04-04\",\"time\":\"16:30:05\",\"sender\":611,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"y el sabado a que horas\\u00bf\",\"date\":\"2017-04-07\",\"time\":\"00:23:56\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Que tal a las 10 am, en realidad no tendr\\u00eda problema con cualquier otra hora,  que hora te queda mas c\\u00f3moda?\",\"date\":\"2017-04-07\",\"time\":\"02:50:33\",\"sender\":611,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Jum hasta ahora veo el mensaje\",\"date\":\"2017-04-08\",\"time\":\"13:29:32\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"A las 2 o 3?\",\"date\":\"2017-04-08\",\"time\":\"13:33:49\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"En donde?\",\"date\":\"2017-04-08\",\"time\":\"13:34:04\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Que tal a las 2 en la biblioteca central?\",\"date\":\"2017-04-08\",\"time\":\"13:45:16\",\"sender\":611,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Listo\",\"date\":\"2017-04-08\",\"time\":\"14:10:25\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-08\",\"time\":\"15:04:52\",\"sender\":611,\"state\":5,\"deal\":70,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-08\",\"time\":\"15:07:00\",\"sender\":624,\"state\":5,\"deal\":\"70\",\"dealState\":7},{\"message\":\"Estar\\u00e9 entonces  en la entrada de la biblioteca a las 2,  llevare mi guitarra. \",\"date\":\"2017-04-08\",\"time\":\"15:19:27\",\"sender\":611,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"mi numero de tel\\u00e9fono es 3118391333.\",\"date\":\"2017-04-08\",\"time\":\"16:23:50\",\"sender\":611,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Llevo la mia?\",\"date\":\"2017-04-08\",\"time\":\"18:02:33\",\"sender\":624,\"state\":5,\"deal\":0,\"dealState\":0}]