":5,\"deal\":0,\"dealState\":0},{\"message\":\"Qu\\u00e9 pena contestarte hasta ahora.  Yo dir\\u00eda que nos podr\\u00edamos encontrar en la U para que practiques el tejido. Yo te digo qu\\u00e9 materiales necesitas y qu\\u00e9 puedo llevar yo.\",\"date\":\"2017-04-10\",\"time\":\"03:44:25\",\"sender\":379,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-31 01:52:51','2017-04-26 04:28:10'),(181,373,380,'[{\"message\":\"Hola Jaiber, te escribe Oscar. Me interesa tu oferta porque estoy en prototipado de mi emprendimiento (alimentaci\\u00f3n fit). Si te parece bien, te puedo apoyar en temas de CyT, gesti\\u00f3n, emprendimiento o salsa.\",\"date\":\"2017-03-30\",\"time\":\"21:34:40\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-03-31\",\"time\":\"23:03:13\",\"sender\":602,\"state\":5,\"deal\":65,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-03\",\"time\":\"14:39:14\",\"sender\":380,\"state\":5,\"deal\":\"65\",\"dealState\":7},{\"message\":\"Buen d\\u00eda. Me queda perfecto. Estos d\\u00edas estoy trabajando desde la Hemeroteca.\",\"date\":\"2017-04-03\",\"time\":\"14:40:02\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buen d\\u00eda. Me queda perfecto. Estos d\\u00edas estoy trabajando desde la Hemeroteca. \\u00bfTienes l\\u00edo si voy con mi compa\\u00f1ero de emprendimiento? \",\"date\":\"2017-04-03\",\"time\":\"14:40:39\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00bfPor d\\u00f3nde nos podemos comunicar? La vez pasada estuvo ca\\u00edda la plataforma y no pude lograr un encuentro. Si quieres p\\u00e1same tu WA o FB o si manejas alg\\u00fan cliente de mensajer\\u00eda instant\\u00e1nea.\",\"date\":\"2017-04-03\",\"time\":\"14:41:41\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buenas tardes Oscar mi n\\u00famero de contacto es 3147904777. No hay problema con el compa\\u00f1ero de emprendimiento. Me avisa cualquier novedad para el encuentro.\",\"date\":\"2017-04-03\",\"time\":\"18:37:53\",\"sender\":602,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Vale. Nos vemos el mi\\u00e9rcoles. Cualquier novedad estamos en contacto por WA. El m\\u00edo es 310 8857432.\",\"date\":\"2017-04-03\",\"time\":\"22:14:40\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-31 02:34:40','2017-04-08 18:07:30'),(182,391,323,'[{\"message\":\"Hola Ricardo, soy Diego Econom\\u00eda y hago teatro calle, estoy interesado en tu clase de aerografia, pero en que espacio la podr\\u00eda tomar o con que elementos? gracias :) !\",\"date\":\"2017-03-31\",\"time\":\"16:52:22\",\"sender\":323,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-03-31 21:52:22','2017-04-05 03:00:26'),(183,393,150,'[{\"message\":\"Buen d\\u00eda, Laura.\\r\\nSoy estudiante, como t\\u00fa lo fuiste, de psicolog\\u00eda.\\r\\nSiento que s\\u00e9 las parte gramatical, y por eso te escribo, porque me hace falta -mucha- la pr\\u00e1ctica conversacional; entonces, si gustas ayudarme, estar\\u00e9 muy agradecido.\",\"date\":\"2017-03-31\",\"time\":\"19:53:47\",\"sender\":150,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-01 00:53:47','2017-04-01 00:53:47'),(184,338,544,'[{\"message\":\"Hola! Mi nombre es Juliette, soy estudiante de qu\\u00edmica y me siempre me ha parecido interesante la cosmetologia, me interesar\\u00eda tomar tu oferta \",\"date\":\"2017-04-01\",\"time\":\"03:40:51\",\"sender\":544,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buenas Tardes Juliette, claro, dame por favor un correo electronico para enviarte la informacion y un numero de contacto para llamarte. Mi numero de celular es 3124344198. Quedo atenta. Gracias. Cordial Saludo\",\"date\":\"2017-04-10\",\"time\":\"23:26:41\",\"sender\":561,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-01 08:40:51','2017-04-11 04:26:41'),(185,255,646,'[{\"message\":\"Hola, me llamo Lina y estoy haciendo mi tr