','2017-04-03 03:33:51','2017-04-07 18:29:01'),(189,31,646,'[{\"message\":\"Hola, Me llamo Lina! Estoy haciendo mi trabajo de grado de Maestr\\u00eda y necesito asesor\\u00eda en cruzar una informaci\\u00f3n para generar unos mapas que semaforicen a Colombia. Quisiera saber si podemos hablar y si podr\\u00eda llegar a ayudarme. Un saludo, \",\"date\":\"2017-04-02\",\"time\":\"22:41:31\",\"sender\":646,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-03 03:41:31','2017-04-03 21:10:10'),(190,393,143,'[{\"message\":\"Hola Laura como estas, soy Andres, me encantar\\u00eda poder practicar mi ingles para seguir mejorando, me apasiona aprender. mis datos de contacto son anmdiazpe@unal.edu.co - 317 374 6498 por si hay posibilidades de poder aprender de Ti. cordial saludo!\",\"date\":\"2017-04-03\",\"time\":\"03:51:06\",\"sender\":143,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-03 08:51:06','2017-04-03 08:51:06'),(191,338,637,'[{\"message\":\"Hola Luz Marina. Soy Biologa de la UN y me interesa tu oferta.\\r\\n\\r\\nMe gustar\\u00eda escuchar tu oferta. Puedes contactarme al 6873514  o 3133010308\\r\\n\\r\\nTe propongo que me presentes tus productos en la UN. Que tal el viernes a las 10am?\",\"date\":\"2017-04-03\",\"time\":\"15:37:23\",\"sender\":637,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buenas Tardes Zulay, puedes llamarme al 3124344198. Podr\\u00edamos reunirnos la pr\\u00f3xima semana el jueves a las 2 de la tarde si te parece en la Nacional. Gracias. Cordial Saludo\",\"date\":\"2017-04-10\",\"time\":\"23:28:20\",\"sender\":561,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-03 20:37:23','2017-04-11 16:59:56'),(192,275,577,'[{\"message\":\"Hola, Leonardo, espero est\\u00e9s bien. Mi nombre es Rub\\u00e9n y los jardines verticales me parecen una soluci\\u00f3n hermosa a la falta de verde en las ciudades. Cu\\u00e9ntame, c\\u00f3mo podr\\u00edamos hacer.\",\"date\":\"2017-04-03\",\"time\":\"15:49:33\",\"sender\":577,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Rub\\u00e9n, gracias por el inter\\u00e9s. La idea es tener una primera sesi\\u00f3n de generalidades y definici\\u00f3n del dise\\u00f1o, ya en una segunda sesi\\u00f3n con los materiales indicados se elaborar\\u00eda un peque\\u00f1o jard\\u00edn vertical. Hay otras personas interesadas y he pensado en hacer como un taller todos juntos para de paso compartir experiencias al respecto, que nos rinda m\\u00e1s en el montaje y los costos disminuyan. Tengo en mente un viernes en la tarde, quedo atento\",\"date\":\"2017-04-04\",\"time\":\"02:00:58\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola, Leonardo, si, de una! quedo entonces atento, mi n\\u00famero de wpp es 3144292838 por si deseas hacer un grupo de wpp y comunicarnos por all\\u00e1 para lo del taller que me comentas. Saludos y buena energ\\u00eda.\",\"date\":\"2017-04-06\",\"time\":\"17:20:24\",\"sender\":577,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-09\",\"time\":\"23:00:08\",\"sender\":59,\"state\":5,\"deal\":72,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-10\",\"time\":\"14:23:56\",\"sender\":577,\"state\":5,\"deal\":\"72\",\"dealState\":7}]','2017-04-03 20:49:33','2017-04-11 05:28:47'),(193,152,380,'[{\"message\":\"Hola Rolando, te escribe Oscar. Me interesa tu oferta porque estoy en prototipado de mi emprendimiento (stand de alimentaci\\u00f3n fit). Si te parece bien, te puedo apoyar en temas de CyT, gesti\\u00f3n, emprendimiento o salsa.\",\"date\":\"2017-04-03\",\"time\":\"19:49:49\",\"sender\":380,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Oscar, disculpa que no haya contestado antes. Andaba fuera de la ciudad. \",\"date\":\"2017-04-15\",\"time\":\"16:55:16\",\"sender\":265,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Si te parece intentemos hacer el cambalache. La verdad no se me ocurre en principio qu\\u00e9 solicitarte (pero no creo que sea la salsa, en eso me defiendo decentemente). Suena bien lo del stand de alimentaci\\u00f3n fit\",\"date\":\"2017-04-15\",\"time\":\"16:56:43\",\"sender\":265,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Vale, no hay l\\u00edo. Parece que no es necesario el intercambio. Creo que recibes un dorado (a mi me lo descuentan) y lo puedes usar en algo que necesites :P. \\u00bfC\\u00f3mo andas de tiempo esta semana?\",\"date\":\"2017-04-17\",\"time\":\"14:42:11\",\"sender\":380,\"state\":6,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00bfMi\\u00e9rcoles en la tarde te parece?\",\"date\":\"2017-04-17\",\"time\":\"16:02:32\",\"sender\":380,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-04 00:49:49','2017-04-17 21:02:32'),(194,398,648,'[{\"message\":\"Hola, soy Isaac. Me parece interesante su oferta. Me gustar\\u00eda saber un poco m\\u00e1s de mis antecedentes hist\\u00f3ricos. Hay posibilidad de que la actividad pueda realizarse un viernes o alg\\u00fan fin de semana? De igual manera tengo libres de 2 a 4 de lun a jue\",\"date\":\"2017-04-04\",\"time\":\"02:50:39\",\"sender\":648,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Claro, viernes o fin de semana, lunes, jueves, no hay problema. Creo que es mejor si tiene acceso a un computador (en vez de smartphone, pero podemos probar). \",\"date\":\"2017-04-04\",\"time\":\"03:19:29\",\"sender\":505,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"FamilySearch es una base gratis, y est\\u00e1 en construcci\\u00f3n. Entonces tienen info de algunos departamentos, pero no de otros, y de algunos municipios, pero no de otros. \",\"date\":\"2017-04-04\",\"time\":\"03:20:29\",\"sender\":505,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Y de unos pa\\u00edses pero no de otros. Si me dice qu\\u00e9 pa\\u00edses, deptos y municipios le interesan, podemos ver si hay buen material digitalizado.\",\"date\":\"2017-04-04\",\"time\":\"03:22:41\",\"sender\":505,\"state\":5,\"deal\":0,\"dealSta