anahoria y nueces, naranja y yogurt  con  semillas de amapola, de ahuyama, coco y uvas pasas o de frutos rojos con semillas de amapola. Si quieres solo traes 1 kl. de harina de trigo sin levadura, 500 gr. de mantequilla sin sal de Alpina y  6 huevos.   Depende de cu\\u00e1l sea la que prefieras hacer en clase traes o bien  300 gr. de zanahoria, un par de naranjas  o  fresas y moras.  Vivo en Suba AuresI. no s\\u00e9 si te queda bien, ya que por el tema de la cocina siempre prefiero estar en la m\\u00eda por la familiarizaci\\u00f3n con este espacio.  Para que tomes la clase estoy disponible todas las tardes incluso el s\\u00e1bado. Me dir\\u00e1s cuando tienes tiempo. Y gracias por el inter\\u00e9s!! \",\"date\":\"2017-04-05\",\"time\":\"02:00:22\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Te parece si nos vemos en esta semana santa? o mejor la semana despu\\u00e9s de semana santa? si es despu\\u00e9s tendr\\u00eda que ser un viernes en la tarde o sabado, como dices que podr\\u00edas pues de una :D.\",\"date\":\"2017-04-07\",\"time\":\"14:35:45\",\"sender\":296,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Dale, en semana santa ser\\u00eda genial el jueves a eso de las 2pm. Me dir\\u00e1s cu\\u00e1l de las tortas te interesa exactamente y la preparamos ese d\\u00eda. Quedo atenta. \",\"date\":\"2017-04-07\",\"time\":\"23:12:50\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Listo, queda anotado, si me sale algo de paseo te estoy avisando con tiempito.\",\"date\":\"2017-04-08\",\"time\":\"16:28:36\",\"sender\":296,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Suena rico el de naranja y yogurt, entonces que yogurt llevo o que marca recomiendas :D\",\"date\":\"2017-04-08\",\"time\":\"16:29:01\",\"sender\":296,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"el yogurt es sin natural sin dulce. La marca es Tapioca y lo venden en el exito. con un vasito es suficiente\",\"date\":\"2017-04-10\",\"ti