te\":0},{\"message\":\"Podr\\u00eda ser la otra semana si no tienes planes de viajar en vacaciones. Y pues cuadramos un lugar porque requerimos de un horno, pongo a tu consideraci\\u00f3n la casa de mi suegra en Fontib\\u00f3n que tiene un horno de panader\\u00eda maravilloso.\\n\",\"date\":\"2017-04-05\",\"time\":\"20:39:29\",\"sender\":558,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Me avisas para proponer el acuerdo y te digo de ingredientes :D\",\"date\":\"2017-04-05\",\"time\":\"20:39:59\",\"sender\":558,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Entonces dile a tu suegra que prepare el horno. Vivo en Hayuelos, a un paso de Fontib\\u00f3n. Que sea el martes 11 a las 10 am?\",\"date\":\"2017-04-06\",\"time\":\"04:53:13\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Espero tu respuesta! Me interesa porque se acerca mi cumplea\\u00f1os y me encantan los Alfajores, quiero \\u00e9sta vez obsequiar en el d\\u00eda aquel a quienes me acompa\\u00f1en uno. Quedo atento :)\",\"date\":\"2017-04-06\",\"time\":\"04:54:52\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola! Que pena, no hab\\u00eda podido responder.\",\"date\":\"2017-04-10\",\"time\":\"18:41:27\",\"sender\":558,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Ma\\u00f1ana no puedo pero... te parece el mi\\u00e9rcoles a las 10am.? Con eso alcanzas a comprar los ingredientes!\",\"date\":\"2017-04-10\",\"time\":\"18:42:02\",\"sender\":558,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Necesitamos 1\\/4 de libra de mantequilla Colanta o Alpina (sin sal),  1\\/2lbr. de Maizena, 1\\/4lbr. de Az\\u00facar pulverizada, 1\\/2lbr. de Harina de trigo, 2 huevos peque\\u00f1os, 1\\/4 cucharadita polvo de hornear, 3 limones grandes bien verdes, 1\\/4lbr de coco rallado  y un tarrito de 500gr. de arequipe para obleas\",\"date\":\"2017-04-10\",\"time\":\"18:48:23\",\"sender\":558,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u0