 cu\\u00e1nto de cada una? Pudiera ser \\u00e9ste fin de semana? en las horas de la tarde me queda de maravilla. Espeoro tu respuesta \",\"date\":\"2017-04-06\",\"time\":\"04:50:20\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola! Quiero probar con Mora, Agraz y Kiwi. Me gustan esas mucho, cu\\u00e1nto de cada una? \\nPudiera ser \\u00e9ste fin de semana? en las horas de la tarde me queda de maravilla. Espero tu respuesta \",\"date\":\"2017-04-06\",\"time\":\"04:50:39\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Andr\\u00e9s,Hola!! favor disculpa.  Se viene semana Santa y pensaba que l s\\u00e1bado 23 si!.  Entre semana no puedo porque trabajo todo el d\\u00eda. mi Correo es elianatrujillosuarez@gmail.com .  Para adelantar algo, piensa en qu\\u00e9 vas a guardar las mermeladas, unos frascos con tapa herm\\u00e9tica; La cantidad de fruta: m\\u00ednimo media libra de Agraz, de kiwi y de Mora una libra. Las compras cuando ya tengamos la fecha , deben de estar maduras pero no sobremaduras!  Saludos.\",\"date\":\"2017-04-06\",\"time\":\"12:59:34\",\"sender\":652,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-05 08:27:01','2017-04-06 23:03:42'),(203,402,653,'[{\"message\":\"Hola! Me interesa tomar tu oferta ya que en los pr\\u00f3ximos d\\u00edas se acerca mi cumplea\\u00f1os y quiero sorprender a todos con \\u00a1una torta exquisita!\\r\\nPropongo el s\\u00e1bado 15 o domingo 16 a las 2PM.\\r\\n\\r\\n\\u00bfTe interesa?\\r\\n:)  \",\"date\":\"2017-04-05\",\"time\":\"03:35:15\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Buen d\\u00eda Andr\\u00e9s!! Las tortas que elaboro son artesanales, hay varias opciones entre las que te puedo ense\\u00f1ar a preparar:\",\"date\":\"2017-04-05\",\"time\":\"16:18:27\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Zanahoria y nueces.  Banano y agraz. Naranja, yogurt y semillas de amapola. Frutos rojos y semillas o de ahuyama con coco y uvas pasas. Tu me dir\\u00e1s cu\\u00e1l deseas preparar y la hacemos ese d\\u00eda en mi cocina, si quieres traes los ingredientes y obviamente te la llevas a tu casa para que la disfrutes.  Vivo en Suba Aures I, es muy f\\u00e1cil llegar en transmi y ser\\u00eda perfecto el s\\u00e1bado 15. Gracias por el inter\\u00e9s y estamos en contacto. Lindo d\\u00eda!!\",\"date\":\"2017-04-05\",\"time\":\"16:22:50\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola! Gracias, espero que tambi\\u00e9n hayas pasado excelente d\\u00eda. Prepara receta para el 15 entonces, porque la torta de Naranja, yogurt y semillas de Amapola te debe queda exquisita \",\"date\":\"2017-04-06\",\"time\":\"04:58:00\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Dependiendo el tiempo que demore, tu me dices si llego a las 2PM o a las 11AM. Quedo atento! :)   PD. Linda noche\",\"date\":\"2017-04-06\",\"time\":\"04:58:58\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola, a las 2pm el s\\u00e1bado ser\\u00eda genial. Me tendr\\u00edas que decir cu\\u00e1l de los sabores te interesa para que te pueda decir los ingredientes. Quedo atenta a tu respuesta. \",\"date\":\"2017-04-07\",\"time\":\"23:08:25\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola! Pues como te escrib\\u00ed arriba. El que me llam\\u00f3 la atenci\\u00f3n: Naranja, yogurt y Semillas de Amapola. Yo quedo atento pa que me digas los ingredientes.\",\"date\":\"2017-04-08\",\"time\":\"11:50:22\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Los ingredientes son :\",\"date\":\"2017-04-10\",\"time\":\"15:12:40\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"250gr de mantequilla son sal (alpina preferiblemente), 3 naranjas tangelo, 1 sobre peque\\u00f1o de polvo para hornear, 200 gr de harina de trigo natural, 200 gr de az\\u00facar pulverizada, 1 vasito de yogurt natural sin dulce (tapioca, lo venden en el exito) 3 huevos. Con estos ingredientes  alcanzamos hacer una torta para 6 personas, si quieres una m\\u00e1s grande tendr\\u00edamos que duplicar los ingredientes. Saludos. \",\"date\":\"2017-04-10\",\"time\":\"15:16:38\",\"sender\":649,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-13\",\"time\":\"02:52:04\",\"sender\":649,\"state\":5,\"deal\":82,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-14\",\"time\":\"01:50:03\",\"sender\":653,\"state\":5,\"deal\":\"82\",\"dealState\":7},{\"message\":\"Propuesta Cancelada\",\"date\":\"2017-04-15\",\"time\":\"14:27:44\",\"sender\":653,\"state\":5,\"deal\":\"82\",\"dealState\":8},{\"message\":\"Propuesta Cancelada\",\"date\":\"2017-04-15\",\"time\":\"14:27:44\",\"sender\":653,\"state\":5,\"deal\":\"82\",\"dealState\":8},{\"message\":\"Buenos d\\u00edas. Recibe un cordial saludo. Por asuntos personales y de casa, temo decirte que no podemos realizar el cambalache o de hoy. Te pido mil disculpas por eso, pero es de suma importancia atender \\u00e9sto. Yo te escribo nuevamente para reprogramar todo. Gracias\",\"date\":\"2017-04-15\",\"time\":\"14:29:22\",\"sender\":653,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-05 08:35:15','2017-04-15 22:40:21'),(204,266,161,'[{\"message\":\"Hola Juli\\u00e1n. Soy Alejandro, estudiante de computaci\\u00f3n. Estoy interesado en la oferta porque usualmente hago presentaciones en p\\u00fablico y quisiera mejorar mis habilidades de fluidez, lenguaje corporal, etc. Que esperas recibir a cambio? \",\"date\":\"2017-04-05\",\"time\":\"15:46:53\",\"sender\":161,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Lo siento, llevaba un tiempo sin entrar aqu\\u00ed.\",\"date\":\"2017-04-09\",\"time\":\"21:28:40\",\"sender\":462,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"No es necesario un trueque, en todo caso si llegamos a un acuerdo, podr\\u00edamos discutirlo el persona o dejarlo as\\u00ed\",\"date\":\"2017-04-09\",\"time\":\"21:29:40\",\"sender\":462,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Vale. Qu\\u00e9 d\\u00eda y a qu\\u00e9 hora podr\\u00edas?\",\"date\":\"2017-04-10\",\"time\":\"15:07:56\",\"sender\":161,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-05 20:46:53','2017-04-10 20:07:56'),(205,325,364,'[{\"message\":\"Buenas noches, me llamo Fabian.\\r\\nDesde hace mucho he estado interesado en estas propuestas y me gustaria conocer m\\u00e1s sobre el mapeo participativo mediante \\u00e9stas herramientas.\\r\\n\\r\\ngracias\",\"date\":\"2017-04-06\",\"time\":\"02:12:31\",\"sender\":364,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-06 07:12:31','2017-04-06 07:12:31'),(206,255,364,'[{\"message\":\"Hola soy Fabian,\\r\\nestoy en el pregrado de geograf\\u00eda y ser\\u00eda interesante conocer sobre aplicacion de SIG en problematicas ambientales. \\r\\n\\r\\nMuchas Gracias\",\"date\":\"2017-04-06\",\"time\":\"02:18:19\",\"sender\":364,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-06 07:18:19','2017-04-06 07:18:19'),(207,394,381,'[{\"message\":\"Hola, soy Flor. Estudio m\\u00fasica y me parece super \\u00fatil tener una clase de teatro contigo. Dime con qu\\u00e9 disponibilidad horaria cuentas. \\r\\nGracias.\",\"date\":\"2017-04-06\",\"time\":\"15:11:04\",\"sender\":381,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-06 20:11:04','2017-04-06 20:11:04'),(208,279,381,'[{\"message\":\"Hola. Soy Flor, estudiante de m\\u00fasica de la Academia Luis A Calvo. Te cuento que me he comenzado a interesar mucho por la percusi\\u00f3n. Dime c\\u00f3mo se har\\u00edan las clases, qu\\u00e9 necesito y dem\\u00e1s. Un abrazo.\",\"date\":\"2017-04-06\",\"time\":\"15:23:39\",\"sender\":381,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-04-06 20:23:39','2017-04-06 20:23:39'),(209,154,413,'[{\"message\":\"Hola Daniela, \\r\\n\\r\\nMi nombre es Juli\\u00e1n Mondrag\\u00f3n. Estoy interesado en practicar ingl\\u00e9s a nivel conversacional, puede ser de manera virtual o presencial. Mi correo es jamondragong@unal.edu.co.\\r\\n\\r\\nSaludos,\",\"date\":\"2017-04-06\",\"time\":\"18:04:03\",\"sender\":413,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola Julian, dale pues si te parece bien despues de semana santa, podria el martes luego de las 11 am en el campus\",\"date\":\"2017-04-07\",\"time\":\"15:55:30\",\"sender\":270,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-06 23:04:03','2017-04-09 19:04:15'),(210,275,413,'[{\"message\":\"Hola Leonardo,\\r\\n\\r\\nTengo un patio en el que he querido montar un jard\\u00edn vertical pero no he podido sacar tiempo. Me gustar\\u00eda recibir ideas de como organizarlo.\\r\\n\\r\\nSaludos,\",\"date\":\"2017-04-06\",\"time\":\"18:06:26\",\"sender\":413,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-09\",\"time\":\"22:57:30\",\"sender\":59,\"state\":5,\"deal\":71,\"dealState\":4},{\"message\":\"Los viernes despu\\u00e9s de mediod\\u00eda es complicado ingresar a la UN y no podr\\u00eda hacerlo antes. \\u00bfPuede ser otro d\\u00eda?\",\"date\":\"2017-04-10\",\"time\":\"00:53:16\",\"sender\":413,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"La verdad cuadrar otro tiempo es complicado, adem\\u00e1s otras personas interesadas quieren hacer la sesi\\u00f3n grupal para compartir experiencias y reducir los costos de la sesi\\u00f3n pr\\u00e1ctica. Ese mismo d\\u00eda hay reuni\\u00f3n de la p\\u00e1gina de 2-4, escog\\u00ed la fecha y hora asumiendo que todos ir\\u00edamos a la reuni\\u00f3n, si llega antes de las 3 no hay problema para ingresar a la universidad  \",\"date\":\"2017-04-10\",\"time\":\"13:04:59\",\"sender\":59,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Propuesta Cancelada\",\"date\":\"22:58:00\",\"time\":\"22:58:00\",\"sender\":413,\"state\":5,\"deal\":\"71\",\"dealState\":8},{\"message\":\"Hola Leonardo,\",\"date\":\"2017-04-17\",\"time\":\"14:24:29\",\"sender\":413,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\nEntendido. Yo voy a asistir a la reuni\\u00f3n este viernes, as\\u00ed que si la propuesta sigue en pie me interesa. Gracias.\",\"date\":\"2017-04-17\",\"time\":\"14:25:22\",\"sender\":413,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"\\u00a1Has enviado un propuesta!\",\"date\":\"2017-04-18\",\"time\":\"11:22:35\",\"sender\":59,\"state\":5,\"deal\":86,\"dealState\":4},{\"message\":\"Propuesta Aceptada\",\"date\":\"2017-04-18\",\"time\":\"16:21:57\",\"sender\":413,\"state\":5,\"deal\":\"86\",\"dealState\":7}]','2017-04-06 23:06:26','2017-04-19 01:13:15'),(211,404,143,'[{\"message\":\"Hola Ivan, me interesa mucho tomar el curso, se ve bastante interesante, soy estudiante de la unal, tambien ofrezco mas cursos aqui! me quedan facil los martes y miercoles en las tardes, quedo atento para coordinar!! cordial saludo.\",\"date\":\"2017-04-06\",\"time\":\"23:42:32\",\"sender\":143,\"state\":5,\"deal\":0,\"dealState\":0}]','2017-04-07 04:42:32','2017-04-07 16:37:48'),(212,408,361,'[{\"message\":\"Hola Soy \\u00c1ngela. Me interesan mucho tus clases de acrobacia en telas, Qu\\u00e9 horarios tienes disponibles despu\\u00e9s de Semana Santa?\",\"date\":\"2017-04-08\",\"time\":\"13:40:33\",\"sender\":361,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"Hola \\u00c1ngela. Yo podr\\u00eda el mi\\u00e9rcoles de 2:30pm a 4:30pm, podr\\u00edas asistir en ese horario?\",\"date\":\"2017-04-08\",\"time\":\"16:53:23\",\"sender\":655,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"S\\u00faper! en ese horario puedo el mi\\u00e9rcoles 26 de abril, puedes ese dia?\",\"date\":\"2017-04-08\",\"time\":\"18:05:01\",\"sender\":361,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"si ese d\\u00eda puedo :) \",\"date\":\"2017-04-08\",\"time\":\"18:36:21\",\"sender\":655,\"state\":5,\"deal\":0,\"dealState\":0},{\"message\":\"oye,  y puedes este jueves en la tarde en la universidad?\",\"date\":