oder tener el instrumento cerca. No s\\u00e9 que opines :)\",\"date\":\"2017-05-02\",\"time\":\"21:15:05\",\"sender\":694,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-05-01 08:40:00','2017-05-03 02:15:05'),(293,456,637,'[{\"message\":\"Hola, me llamo Zulay y estudie Biolog\\u00eda en la UN. Me interesa tu clase de alem\\u00e1n ya que he estado en Alemania pero solo de turismo. Me gustar\\u00eda hacer un curso de aleman.\\r\\n\\r\\nPara ti esta bien que yo tome tu clase el viernes a las 11am en la UN?\",\"date\":\"2017-05-01\",\"time\":\"14:12:05\",\"sender\":637,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-05-01 19:12:05','2017-05-01 19:12:05'),(294,453,296,'[{\"message\":\"Buen d\\u00eda, me gustar\\u00eda ver como es el asunto para animarme a ser un poco m\\u00e1s activo.\",\"date\":\"2017-05-02\",\"time\":\"19:44:21\",\"sender\":296,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-05-03 00:44:21','2017-05-03 00:44:21'),(295,254,495,'[{\"message\":\"Hola,\\r\\n\\r\\nMe encantar\\u00eda asistir a este taller, por favor av\\u00edsame cuando se complete el cupo para poder desarrollarlo.\\r\\n\\r\\n\",\"date\":\"2017-05-02\",\"time\":\"20:55:19\",\"sender\":495,\"state\":6,\"deal\":0,\"dealState\":0}]','2017-05-03 01:55:19','2017-05-03 01:55:19');
