DROP TABLE IF EXISTS `deals`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `deals` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `service_id` int(10) unsigned NOT NULL,
  `date` date NOT NULL,
  `time` time NOT NULL,
  `location` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `value` int(11) NOT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `conversations_id` int(10) unsigned NOT NULL,
  `response_applicant` tinyint(1) DEFAULT NULL,
  `response_offerer` tinyint(1) DEFAULT NULL,
  `applicant_badObservations_id` int(10) unsigned NOT NULL DEFAULT '1',
  `offerer_badObservations_id` int(10) unsigned NOT NULL DEFAULT '1',
  `applicant_observation` text COLLATE utf8_unicode_ci,
  `offerer_observation` text COLLATE utf8_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `deals_user_id_foreign` (`user_id`),
  KEY `deals_service_id_foreign` (`service_id`),
  KEY `deals_conversations_id_foreign` (`conversations_id`),
  KEY `deals_applicant_badobservations_id_foreign` (`applicant_badObservations_id`),
  KEY `deals_offerer_badobservations_id_foreign` (`offerer_badObservations_id`),
  CONSTRAINT `deals_applicant_badobservations_id_foreign` FOREIGN KEY (`applicant_badObservations_id`) REFERENCES `bad_observations` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `deals_conversations_id_foreign` FOREIGN KEY (`conversations_id`) REFERENCES `conversations` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `deals_offerer_badobservations_id_foreign` FOREIGN KEY (`offerer_badObservations_id`) REFERENCES `bad_observations` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `deals_service_id_foreign` FOREIGN KEY (`service_id`) REFERENCES `services` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `deals_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
