INSERT INTO `service_scores` VALUES (1,1,5,4,'Buena experiencia.',1,'2017-03-22 00:33:53','2017-03-22 00:33:53'),(2,17,3,4,'Todo salio muy bien y aprendí mucho, Gracias',1,'2017-03-22 07:46:39','2017-03-22 07:46:39'),(3,34,2,4,'Buen servicio ',1,'2017-03-22 19:11:54','2017-03-22 19:11:54'),(4,253,5,4,'Buen servicio, aprendi mucho',1,'2017-03-24 03:20:35','2017-03-24 03:20:35'),(5,253,5,0,NULL,2,'2017-03-24 03:52:31','2017-03-24 03:52:31'),(6,253,5,3,'Buen juego',1,'2017-03-24 03:59:12','2017-03-24 03:59:12'),(7,7,3,4,'El servicio fue muy bueno, Gracias.',1,'2017-03-24 21:46:22','2017-03-24 21:46:22'),(8,336,21,5,'Bibiana es la mejor cocinera de alfajores que he conocido!!! Su casa es muy bonita y el trato fue espectacular. Espero volver a intercambiar algún servicio con ella. ',1,'2017-03-29 00:47:35','2017-03-29 00:47:35'),(9,2,59,5,'Muy buena la clase, muchas gracias',1,'2017-03-31 22:15:44','2017-03-31 22:15:44'),(10,191,558,5,'Lo mejor! Jorge Camilo sabe explicar muy bien, es una persona amable y buena gente y lo mejor... explica de manera muy fácil los conceptos.\r\nGracias!',1,'2017-03-31 22:43:10','2017-03-31 22:43:10'),(11,297,59,5,'Muy buena docente, sabe orientar la clase, muy recomendada.',1,'2017-04-04 06:56:29','2017-04-04 06:56:29'),(12,373,380,5,'Estuvo bien.',1,'2017-04-06 00:50:55','2017-04-06 00:50:55'),(13,19,558,5,'Lo máximo!\r\nJuan explica de forma muy clara y sencilla. Además es super buena onda.\r\nMuy puntual y buena gente.\r\nCreo que solicitaré mas clases, vimos lo básico pero quedé antojada de aprender mas.',1,'2017-04-10 23:37:37','2017-04-10 23:37:37'),(14,336,653,5,'Excelente! Esa es la palabra!',1,'2017-04-12 22:29:22','2017-04-12 22:29:22'),(15,226,545,0,NULL,3,'2017-04-14 06:55:35','2017-04-14 06:55:35'),(16,226,545,5,'Mafe tiene una muy buena actitud. Me gustó, me sentí muy comoda.\r\n\r\nMuito obrigada!  \r\n\r\nAté a próxima. :)',1,'2017-04-20 02:22:38','2017-04-20 02:22:38'),(17,421,391,5,'Muy bien. Aprendí mucho muchas gracias.',1,'2017-04-21 02:43:11','2017-04-21 02:43:11'),(18,275,413,5,'Se cumplió lo acordado, superando las expectativas. El tema es muy interesante. ',1,'2017-04-22 06:07:21','2017-04-22 06:07:21'),(19,275,21,5,'El primer encuentro con Leonardo fue más que emocionante. Desde la historia de los Jardines verticales hasta ya tener tareas para crear el nuestro!! Pronto Verán nuestro Jardín.',1,'2017-04-22 10:16:49','2017-04-22 10:16:49'),(20,362,3,5,'Excelente fotógrafo',1,'2017-04-26 22:32:32','2017-04-26 22:32:32');
