INSERT INTO `services` VALUES (1,'Entrenamiento funcional','Ofrezco una hora para hacer entrenamiento funcional al aire libre, donde incluye 20 min de cardio y 40 entrenamiento de todo el cuerpo.',1,NULL,1,'resources/user/user_3/services/img3-1.jpg',12,3,1,'2017-03-21 22:21:28','2017-03-24 22:12:20'),(2,'Ofrezco una clase de Bachata','Ofrezco una hora para practicar los pasos básicos de la bachata.',1,0,1,'resources/user/user_5/services/img5-2.jpg',6,5,1,'2017-03-21 23:57:38','2017-03-21 23:57:38'),(3,'Prácticas de Inglés Conversacional','Ofrezco dos horas de prácticas en Inglés para aquell@s que deseen hablar sobre cualquier tema de interés. Podemos tomarnos un café mientras practicamos y corregimos temas de gramática, estructura, pronunciación y vocabulario.',2,1,1,'resources/user/user_6/services/img6-3.jpg',2,6,1,'2017-03-22 00:19:43','2017-03-22 00:19:43'),(4,'Prácticas de Portugués Conversacional','Oi gente! Ofrezco una hora para practicar Portugués. Podemos encontrarnos y tomarnos un café o hacerlo de forma virtual para hablar de cualquier cosa en Portugués mientras vamos corrigiendo gramática, estructura y vocabulario. ',1,1,1,'resources/user/user_6/services/img6-4.png',2,6,1,'2017-03-22 00:22:28','2017-03-22 00:22:29'),(5,'Clases de programación web','Ofrezco una hora de clases básicas de programación web. Aprende HTML - CSS - JavaSript.',1,0,1,'resources/services/tecnologia01.jpg',11,2,1,'2017-03-22 00:25:00','2017-03-22 00:25:00'),(6,'Clases de karate para principiantes ','Ofrezco dos horas de clases de karate para principiantes.',2,0,1,'resources/services/actividadfisica01.jpg',12,7,1,'2017-03-22 00:34:33','2017-03-22 00:34:33'),(7,'Clases básicas de Teatro','¿Siempre has soñado con ser Actor o Actriz?¿Te gustaría estar en las Tablas alguna vez? Ofrezco dos horas de clase de Teatro para abordar ejercicios de respiración, relajación y expresión corporal de forma básica. Tú eliges el espacio!',2,0,1,'resources/user/user_6/services/img6-7.jpg',6,6,1,'2017-03-22 00:36:09','2017-03-22 00:36:09'),(8,'¿hablas alemán? Sprichst du Deutsch?','Te invito a intercambiar algunas frases sencillas de alemán para dar inicio a como aprender de la manera más fácil y acercarte al idioma. ',1,1,1,'resources/user/user_9/services/img9-8.jpg',2,9,1,'2017-03-22 01:48:51','2017-03-22 01:48:51'),(9,'Corrección de estilo / Proofreading','Quizás quieras tener un segundo lector para revisar si hay errores gramaticales, de redacción etc en inglés. \r\n\r\n',1,1,0,'resources/user/user_9/services/img9-9.jpg',2,9,1,'2017-03-22 02:13:04','2017-03-22 02:13:04'),(11,'Clases de diseño de productos digitales.','Ofrezco una clase de 2 horas para aprender a diseñar el prototipo de tu producto digital con la metodologia Lear UX. \r\n\r\nY empezar tu start-up con menos de 1 dolar ;).',2,NULL,1,'resources/services/administracionynegocios01.jpg',13,14,1,'2017-03-22 05:01:30','2017-03-22 05:01:46'),(12,'Diseño de prototipos para contenido digital','Ofrezco una hora de clase sobre recomendaciones de diseño para la creación de prototipos de aplicativos o portales y su validación con usuarios reales.',1,0,1,'resources/user/user_15/services/img15-12.jpg',11,15,1,'2017-03-22 05:03:32','2017-03-22 05:03:32'),(13,'Clase de Guitarra','Ofrezco un curso de 12 clases, para principantes con el fin de aprender a manejar el instrumento.',2,0,1,'resources/user/user_17/services/img17-13.jpg',3,17,2,'2017-03-22 05:10:54','2017-04-19 20:58:26'),(14,'Clase de salsa basica','Ofrezco una clase de pasos basicos de salsa en un lugar a convenir.\r\n',1,0,1,'resources/user/user_16/services/img16-14.jpg',6,16,1,'2017-03-22 05:20:00','2017-03-22 05:20:00'),(15,'Tertulias literarias','Ofrezco riquísimas y deliciosas tertulias literarias, acompañadas de intercambio de libros, así como visitas guiadas a Macondo, y si alcanzamos a la Tierra Media o Metrópolis. Están cordialmente invitados a ser perjudicados por los libros.',1,1,1,'resources/user/user_19/services/img19-15.jpg',9,19,1,'2017-03-22 06:35:49','2017-03-22 06:35:49'),(16,'Clases de Baloncesto','Ofrezco una hora de clases de baloncesto. Aprende lo basico de este excelente deporte.',1,NULL,1,'resources/user/user_18/services/img18-16.jpg',12,18,1,'2017-03-22 07:15:28','2017-03-24 02:46:10'),(17,'Como hacer un VideoJuego','Ofrezco dos horas para montar un prototipo básico de un videoJuego en Unity.',2,NULL,1,'resources/user/user_20/services/img20-17.jpg',11,20,1,'2017-03-22 07:18:23','2017-03-22 07:22:02'),(18,'Clase de Frances','Ofrezco una hora de una clase de frances para principiantes, combinando la teoría con la práctica.',1,0,1,'resources/user/user_10/services/img10-18.jpg',2,10,1,'2017-03-22 08:44:36','2017-03-22 08:44:36'),(19,'Edición videos en premiere CC','Si quieres poder editar tus vídeos de forma creativa y de alta calidad. No dudes en usar premiere, soy la persona indicada. ',2,1,1,'resources/user/user_21/services/img21-19.gif',8,21,1,'2017-03-22 08:49:26','2017-03-22 08:49:26'),(20,'Programación básica e intermedia','Anímate a conocer el maravilloso mundo de la programación has que tu mente enfrente nuevos desafíos. Clases de una a dos horas empezando por conceptos básicos y ejercicios prácticos hasta temas mas geniales como estructuras de datos ...',1,1,1,'resources/user/user_22/services/img22-20.jpg',11,22,1,'2017-03-22 08:50:33','2017-03-22 08:50:34'),(22,'Entra al mundo Linux ','Si estas interesado en instalar Linux y enterarte mas sobre estos tipos de sistemas operativos, te enseñare desde como instalarlo y tenerlo junto a Windows en tu computador hasta manejo de paquetes y repositorios que te darán una mejor experiencia.',2,1,1,'resources/user/user_22/services/img22-22.png',11,22,1,'2017-03-22 09:04:24','2017-03-22 09:04:24'),(24,'Formateo de computadores','Te puedo ayudar a formatear tu equipo de mesa o portátil, puede ser windows o alguna que otra distribución de linux , instalación de software basico.',3,NULL,1,'resources/user/user_25/services/img25-24.jpg',11,25,1,'2017-