a, Microeconomía básica y guitarra para principiantes. La idea sería encontrarnos en un sitio cercano al campus de la  universidad o en él.',1,0,1,'resources/services/otros01.jpg',14,321,1,'2017-03-23 03:37:58','2017-03-23 03:37:58'),(169,'Traducción Inglés-Español','Buen día:\r\nOfrezco servicio de traducción de documentos. Dependiendo de la extensión, se mostrará la cantidad de horas.',2,1,1,'resources/services/idiomas01.jpg',2,318,1,'2017-03-23 03:39:08','2017-03-23 03:39:08'),(170,'Planos y Asesorías','Dibujo técnico o gráfico. Conozco sobre normatividad colombiana en construcción y propiedad horizontal. También ofrezco clases, si necesitas ayuda con asignaturas de ciencias o software.',1,1,1,'resources/user/user_308/services/img308-170.jpg',14,308,1,'2017-03-23 03:40:54','2017-03-23 03:40:55'),(171,'Clase de fundamentos de Economía. ',' Te ofrezco una clase de Fundamentos de Economía, con previo anuncio de los temas que necesitas. En algún sitio del campus de la Universidad Nacional . ',1,NULL,1,'resources/services/administracionynegocios01.jpg',13,323,1,'2017-03-23 03:43:22','2017-03-31 21:49:51'),(172,'Clase de armónica','Ofrezco clase de armónica diatónica, nivel principiante e intermedio. Podemos encontrarnos en el Campus de la Universidad Nacional, entre 4:00 y 6:00 p.m. de martes a jueves. Indispensable contar con instrumento.',1,0,1,'resources/user/user_314/services/img314-172.jpg',3,314,1,'2017-03-23 03:47:37','2017-03-23 03:47:38'),(173,'Clase de zancos y malabares. ','Ofrezco 1 o 2 horas de clases de zancos o técnica en malabares, incluyendo el material en algún lugar del campus de la Universidad Nacional sede Bogotá.  \r\nTe aseguro que en ese tiempo podrás caminar en ellos.!!',1,0,1,'resources/user/user_323/services/img323-173.jpg',12,323,1,'2017-03-23 03:48:48','2017-03-23 03:48:48'),(174,'jjjj','jjjjjj jjjjj jjjjjj jjjjjjjjjjjjj jjjjj jjjjjj jjjjjjjjjjjjj jjjjj jjjjjj jjjjjjjjjjjjj jjjjj jjjjjj jjjjjjjjjjjjj jjjjj jjjjjj jjjjjjjjjjjjj jjjjj ',1,NU