sis o monografías. La idea es simple: nos reunimos, nos sentamos y cada uno trabaja en su rollo. Beneficio: compartir el tiempo de trabajo es más productivo.  Método: Pomodoro ',1,0,1,'resources/user/user_414/services/img414-233.jpeg',14,414,1,'2017-03-23 18:50:06','2017-03-23 18:50:06'),(234,'Curso de fotografía para empezar','Hola! ofrezco un taller de fotografía básica para iniciar en esta bella práctica. Técnicas, planos, manejo de las utilidades de la cámara. ',1,0,1,'resources/services/arte01.jpg',5,416,1,'2017-03-23 19:40:42','2017-03-23 19:40:42'),(235,'Clase de Química','Ofrezco clases de química nivel bachillerato o universitario',2,1,1,'resources/services/ciencia01.jpg',10,106,1,'2017-03-23 19:42:39','2017-03-23 19:42:39'),(236,'Clase de La naturaleza del ser humano','Ofrezco una hora en el campus de la UN. Preferiblemente los viernes de 10 a 11 am',1,0,1,'resources/services/otros01.jpg',14,417,1,'2017-03-23 19:47:07','2017-03-23 19:47:07'),(237,'Programación, estadística','Ofrezco una hora de clase de programación, estadística básica, bases de datos relacionales y no relacionales, programación en software estadístico como R.',1,1,1,'resources/services/tecnologia01.jpg',11,420,1,'2017-03-23 20:49:51','2017-03-23 20:49:51'),(238,'Clases de yoga y meditación','Ofrezco 1 hora de yoga y meditación para relajar el espiritú y el cuerpo. ',1,0,1,'resources/services/actividadfisica01.jpg',12,7,1,'2017-03-23 20:55:03','2017-03-23 20:55:03'),(240,'Servicios visuales ','Ofrezco pintura al oleo, retrato fotográfico, fotografía de producto, diseño gráfico, diseño editorial, diseño web Joomla, clases de diseño',4,1,0,'resources/user/user_424/services/img424-240.jpg',4,424,1,'2017-03-23 21:27:26','2017-03-23 21:27:26'),(241,'Clase de guitarra acustica','Ofrezco una clase de guitarra acustica , cualquier dia despues de las 5 ',1,0,1,'resources/services/musica01.jpg',3,426,1,'2017-03-23 21:47:38','2017-03-23 21:47:38'),(242,'Clase de jquery y html','Ofrezco clase de jquer