01.jpg',14,479,1,'2017-03-24 09:01:20','2017-03-24 09:01:20'),(275,'Jardines verticales','Ante la angustiante falta de espacio en las ciudades los jardines verticales son la alternativa de inclusión del componente natural en los espacios. Ven y aprende cómo comenzar el tuyo.',1,0,1,'resources/user/user_59/services/img59-275.jpg',4,59,1,'2017-03-24 09:27:12','2017-03-24 09:27:12'),(276,'Valoración por Terapia Ocupacional','Ofrezco un acercamiento desde la perspectiva de Terapia Ocupacional a cualquier persona.',2,0,1,'resources/services/otros01.jpg',14,481,1,'2017-03-24 09:28:19','2017-03-24 09:28:19'),(277,'Clases de WordPress','Ofrezco una capacitación de dos horas de WordPress explicando cómo aplicar temas, editar entradas, páginas, incluir contenido multimedia, etc. Puede ser virtual en cualquier fin de semana o presencial un viernes en la Universidad Nacional.',2,1,1,'resources/user/user_482/services/img482-277.png',11,482,1,'2017-03-24 13:05:08','2017-03-24 13:05:08'),(278,'Asesoría en front-end','Ofrezco asesoría en html y css, aclaración de dudas y ayuda en lo que se necesite a la hora de aplicarlo en una página web funcional y efectiva. Puede ser virtual o acordamos un encuentro en la Universidad Nacional un viernes.',3,1,1,'resources/user/user_482/services/img482-278.png',11,482,1,'2017-03-24 13:14:48','2017-03-24 13:19:31'),(279,'Clases de percusion o teoria musical','Ofresco clases de percusion o teoria musical. \r\nPodemos encontrar en algun lugr de la UN o lugar cercano \r\nLos dias martes y miercoles de 4:00pm a 7:00pm',1,0,1,'resources/services/musica01.jpg',3,484,1,'2017-03-24 17:18:34','2017-03-24 17:18:34'),(280,'programacion de obras e ingles','Ofrezco 1 hora para programación de obras de construcción, incluso inglés',1,1,0,'resources/services/administracionynegocios01.jpg',13,485,1,'2017-03-24 17:55:48','2017-03-24 17:55:48'),(281,'Psicología del Deporte','Ofrezco Clases de psicología aplicada al deporte, contexto del sistema deportivo colombiano