n desarrollo.',2,1,1,'resources/user/user_513/services/img513-310.jpg',11,513,1,'2017-03-25 03:33:57','2017-03-25 03:45:49'),(311,'Asesoría derecho laboral ','Ofrezco una hora de asesoría en derecho laboral, enfocado al área de pensiones. ',1,1,0,'resources/services/otros01.jpg',14,515,1,'2017-03-25 03:53:18','2017-03-25 03:53:18'),(312,'Clases de idiomas, especialmente de francés.','Ofrezco clases de idiomas, podemos acordar una cita cerca del Campus de la Universidad Nacional y los horarios y demás características específicas los vamos acordando. ',1,1,1,'resources/services/idiomas01.jpg',2,518,1,'2017-03-25 05:56:07','2017-03-25 05:56:07'),(313,'Clase de cálculo diferencial','Ofrezco una tutoría de cálculo diferencial, ya sea para reforzar conceptos o empezar desde cero',1,1,1,'resources/services/ciencia01.jpg',10,521,1,'2017-03-25 06:35:31','2017-03-25 06:35:31'),(314,'Mejores fotos con tu celular','Hoy todos tenemos smartphones, saca provecho de su cámara, haz mejores fotografías al entender la luz',1,NULL,1,'resources/services/arte01.jpg',5,522,1,'2017-03-25 07:17:56','2017-03-25 07:21:17'),(315,'Clase de origami','Ofrezco una hora de clase de Origami. Podemos acordar un punto dentro de la universidad. Puedo los lunes de 10 a 11 am ',1,0,1,'resources/services/entretenimiento01.jpg',6,523,1,'2017-03-25 09:07:59','2017-03-25 09:07:59'),(316,'Clase de Inglés','Ofrezco una hora de clase de inglés nivel inicial e intermedio.\r\nEstoy disponible los lunes y jueves en horas de la mañana.',1,1,1,'resources/user/user_525/services/img525-316.jpg',2,525,1,'2017-03-25 09:48:09','2017-03-25 09:57:37'),(317,'Folklore andino','Ofrezco una hora de clase para aprender a interpretar el siku o cañas amarradas propias del sur de Perú y Bolivia. No importa si no tienes el instrumento, podemos usar mis sikus.',1,NULL,1,'resources/user/user_525/services/img525-317.jpg',3,525,1,'2017-03-25 10:20:34','2017-03-25 10:24:02'),(318,'Clases de matemáticas, programación, física.','Una hora de clase de matemáticas o física, en la universidad nacional, en alguna de las bibliotecas de Bogotá.',1,1,1,'resources/services/ciencia01.jpg',10,528,1,'2017-03-25 10:46:19','2017-03-25 10:46:19'),(319,'Partido de fútbol femenino','Ofrezco un picadito de fútbol 5, femenino un sábado en la tarde en la Univesidad Nacional. La que se apunte simplemente tiene que tener todas las ganas de jugar sin miedo.',1,0,1,'resources/services/actividadfisica01.jpg',12,532,1,'2017-03-25 17:15:46','2017-03-25 17:15:46'),(320,'Asesoría en Contabilidad','Ofrezco una hora de asesoría sobre el tema elegido: costos, elaboración de estados financieros, tramites legales para constituir una empresa, entre otros. Podemos acordar el sitio de encuentro en el campus de la Universidad Nacional o por Skype.',1,1,1,'resources/services/administracionynegocios01.jpg',13,533,1,'2017-03-25 17:49:52','2017-03-25 17:49:52'),(321,'Manejo de tiempo y agenda','Puedo enseñarte como organizar tu tiempo utilizando un calendario y una agenda, y así adquirir disciplina en la vida universitaria. Esto te ayudará muchísimo en el momento de organizar tus prioridades y distribuir mejor tus actividades diarias',1,0,1,'resources/services/otros01.jpg',14,284,1,'2017-03-25 19:12:15','2017-03-25 19:12:15'),(322,'Clase de astrofísica y/o mecánica cuántica','Una hora de clase de bases de mecánica cuántica o astrofísica, puede ser dentro del campus de la Universidad Nacional o virtual. Acordaremos horarios luego.',1,1,1,'resources/services/ciencia01.jpg',10,540,2,'2017-03-25 21:56:55','2017-03-28 06:09:06'),(323,'Clase de inglés básica','Ofrezco una clase de inglés introductoria, para las personas que son un poco tímidas y se sienten incómodas y quieren empezar a comunicarse en inglés básico.',1,0,1,'resources/services/idiomas01.jpg',2,541,1,'2017-03-25 22:01:58','2017-03-25 22:01:58'),(324,'Clase de estadística descriptiva','Ofrezco una hora de clase, debe ser dentro de la Universidad Nacional ',1,0,1,'resources/services/ciencia01.jpg',10,542,1,'2017-03-25 22:43:30','2017-03-25 22:43:30'),(325,'Taller de herramientas humanitarias TIC','Ofrezco un taller virtual o presencial en el uso de herramientas libres útiles para el campo humanitario: Mapeo y coordinación de respuesta humanitaria, indicadores sociales, censos en campo y narrativas con datos geográficos.',3,1,1,'resources/user/user_543/services/img543-325.png',11,543,1,'2017-03-25 22:51:16','2017-03-26 03:13:56'),(326,'Clase de programación básica en R','Ofrezco dos horas de clase de programación en R, en la Universidad Nacional',2,0,1,'resources/services/tecnologia01.jpg',11,542,1,'2017-03-25 22:54:33','2017-03-25 22:54:33'),(328,'Clase de química básica','Ofrezco una hora de clase de química, puede ser cerca a la Universidad Nacional, en un horario a convenir.',1,1,1,'resources/services/ciencia01.jpg',10,544,1,'2017-03-26 01:03:47','2017-03-26 02:29:04'),(329,'Clases de escritura creativa','Clases (tipo taller) de escritura creativa. Para leer y trabajar en tus textos literarios (cuentos, poemas...). Podemos hablar temas como creación de personajes, tipos de narrador, tipos de poesía, etc.  \r\nLugar: UN',1,NULL,1,'resources/user/user_545/services/img545-329.jpg',9,545,1,'2017-03-26 01:53:00','2017-03-26 01:53:56'),(331,'Cubo de Rubik.','Aprende a armar el cubo de Rubik con los 7 pasos básicos.',1,0,1,'resources/services/entretenimiento01.jpg',6,391,1,'2017-03-26 04:39:45','2017-03-26 04:39:45'),(332,'Aun no quiero ofrecer nada ','Pero la herramienta, para conocerla, me obliga a llenar una oferta. Quisiera conocer esta herramienta, navegar un poco y ahí si ver si tengo algo para ofrecer. \r\n',1,1,0,'resources/services/otros01.jpg',14,551,1,'2017-03-26 06:30:43','2017-03-26 06:30:43'),(333,'Clases de Skate.','Ofrezco clases de skate, incluyo la patineta en las sesiones, por clases de lo que sea.\r\n\r\nPreferiblemente práctica. ',1,1,1,'resources/user/user_554/services/img554-333.jpg',12,554,1,'2017-03-26 11:49:29','2017-03-26 11:49:29'),(334,'Clases de patinaje, habilidades básicas (quads) ','Ofrezco una hora de patinaje en quads para principiantes, puede ser en pista plana o en rampas, importante contar con rodilleras y casco para las rampas. Puedo realizar la sesión los viernes después de las 12 y los lunes a las 11 dentro del campus .',1,0,1,'resources/user/user_556/services/img556-334.jpg',12,556,1,'2017-03-26 20:36:06','2017-03-26 20:36:06'),(335,'Diseño de tu casa','Ofrezco el diseño estructural e interior de un (1) inmueble. Puede ser tu casa actual para remodelar o tu futura casa... esa que estas pensando construir. Podemos reunirnos en torno al campus de la Universidad Nacional en horario de oficina Lun-Sab.',4,1,1,'resources/user/user_555/services/img555-335.png',4,555,1,'2017-03-26 20:45:52','2017-03-26 20:45:52'),(336,'Alfajores Caseros','Ofrezco enseñarte a hacer una receta familiar... deliciosos alfajores caseros!!! Podemos compartir un encuentro de 2 horas para prepararlos, Tu pones el horno y los ingredientes, yo un buen café para poder hacer la prueba de calidad! :D ¿Interesados?',2,NULL,1,'resources/user/user_558/services/img558-336.jpg',1,558,1,'2017-03-26 21:42:00','2017-03-29 00:14:42'),(337,'Clase de química','Ofrezco una o dos horas de clases de química básica. Tengo disponibilidad los fines de semana. ',2,1,1,'resources/services/ciencia01.jpg',10,271,1,'2017-03-26 22:29:44','2017-03-26 22:29:44'),(338,'Cosmética Sostenible','Ofrezco una oportunidad de negocio para llegar al mercado juvenil y con conciencia medioambiental con productos cosméticos pensados de manera ecológica y sostenible. La disponibilidad de tiempo es flexible según el interesado.',2,1,1,'resources/user/user_561/services/img561-338.jpg',13,561,1,'2017-03-26 22:55:55','2017-03-26 22:55:55'),(340,'creatividad y reutilización de materiales.','Ofrezco una hora de taller para aprender  bellas y creativas formas de reutilizar o reciclar piezas de madera o elementos encontrados en la calle o en casa que ya no usemos.',1,1,1,'resources/user/user_563/services/img563-340.jpeg',5,563,1,'2017-03-27 04:10:34','2017-03-27 05:37:12'),(341,'Asesoría en planes de negocio, modelos de negocio','Ofrezco asesoría en planes de negocio, modelos de negocio e innovación.  Pido 2 dorados por 1 hora de clase.',1,1,0,'resources/services/administracionynegocios01.jpg',13,564,1,'2017-03-27 05:40:24','2017-03-27 05:40:24'),(342,'Fundamentos en baloncesto','Ofrezco una hora de entrenamiento de baloncesto para principiantes. Un espacio para aprender un poco de este deporte y para divertirse. Fui jugador activo durante 10 años.  ',1,NULL,1,'resources/user/user_566/services/img566-342.jpg',12,566,1,'2017-03-27 07:48:26','2017-03-27 09:48:21'),(343,'Clase de voleyball','Ofrezco una clase de bases para jugar voleyball y/o ejercicios para mejorar su técnica. Podemos reunirnos en las canchas de la Universidad Nacional, yo llevo el balón. ',2,0,1,'resources/services/actividadfisica01.jpg',12,568,1,'2017-03-27 09:30:16','2017-03-27 09:30:16'),(344,'Asesoría en escritura de textos','Ofrezco dos horas de asesoría para la producción de un texto específico. Durante la asesoría puedo brindar algunas herramientas claves para su uso en otros textos.',2,0,1,'resources/services/literatura01.jpg',9,569,1,'2017-03-27 16:18:49','2017-03-27 16:18:49'),(345,'Clases de yoga','Es una clase de yoga inbound que contiene parte teórica y parte práctica, podemos cuadrarla en la Universidad Nacional o cerca a mi casa por ciudadela colsubsidio.',2,0,1,'resources/user/user_571/services/img571-345.jpg',12,571,1,'2017-03-27 19:27:42','2017-03-27 19:27:42'),(347,'Clases de entrenamiento Personalizado','Ofrezco una hora de clase personalizada,( diferentes modalidades de entrenamiento ).Podemos acordar lugar y horarios.',1,0,1,'resources/services/actividadfisica01.jpg',12,574,1,'2017-03-27 19:59:19','2017-03-27 19:59:19'),(349,'Energías renovables: Biomasa','Ofrezco un curso introductorio de energías renovables enfocado principalmente al uso de la biomasa',1,1,0,'resources/services/ciencia01.jpg',10,575,1,'2017-03-27 20:13:05','2017-03-27 20:13:05'),(350,'Todo lo relacionado con electrónica ','Asesorías en temas relacionados con electrónica, automatización, control, programación.',1,1,1,'resources/services/tecnologia01.jpg',11,578,1,'2017-03-27 20:31:28','2017-03-27 20:31:28'),(351,'Taller de Sensorialidad','Hola, ofrezco taller de Sensorialidad Cotidiana. Sintamos el mundo y a las personas. Es un taller Teórico Práctico de 3 horas de duración y el sitio es de mutuo acuerdo.',2,0,1,'resources/services/otros01.jpg',14,577,1,'2017-03-27 20:32:58','2017-03-27 20:32:58'),(352,'asesoría en planificación familiar,  ','Ofrezco asesorías  en temas  relacionados  con prevención y mantenimiento  de  la  salud. ',1,0,1,'resources/services/otros01.jpg',14,576,1,'2017-03-27 20:35:35','2017-03-27 20:35:35'),(353,'Clases de Magia con cartas!','Ofrezco clases de magia con cartas. No se necesitan conocimientos previos,  solo voluntad y una buena baraja de cartas. Punto de encuentro, preferiblemente cerca a U Nacional, miércoles y viernes. ',2,0,1,'resources/user/user_508/services/img508-353.jpg',14,508,1,'2017-03-27 20:48:15','2017-03-27 20:48:15'),(354,'Clase de metrologia ','puedo realizar una sesión los miércoles desde las 11:00.',1,0,1,'resources/services/tecnologia01.jpg',11,579,1,'2017-03-27 21:14:42','2017-03-27 21:14:42'),(355,'Asesoría en psicología.','Ayudo en temas de Salud Sexual y Reproductiva, Orientación Vocacional, Conflictos de Familia o Pareja, Duelo, investigación... lo que sea que esté relacionado con psicología y no sea en el área organizacional. Puedo después de las 5 pm o findes.',2,NULL,1,'resources/user/user_581/services/img581-355.jpg',14,581,1,'2017-03-27 22:17:07','2017-03-27 22:35:14'),(356,'Asesoría en Planificación. ','Trabajo en una Fundación que maneja el tema, entonces tengo acceso a métodos o a condones. Si como pareja quieren tomar la charla, también lo pueden hacer. ',1,NULL,1,'resources/user/user_581/services/img581-356.jpg',14,581,1,'2017-03-27 22:30:45','2017-03-27 22:49:14'),(357,'Enseño a andar en bicicleta','Amo las bicicletas, es una de mis pasiones. De hecho tengo una que se llama Rosita, como la Rosa del Principito. Así que si quieres aprender a montar en bici, yo te puedo enseñar y tengo una bicleta extra, también para enseñarte. ',2,NULL,1,'resources/user/user_581/services/img581-357.jpg',12,581,1,'2017-03-27 22:34:27','2017-03-27 22:48:11'),(358,'Dar paseos.','Me encantan las caminatas, así que si quiere conocer un poco más la linda Bogotá. Vamos a dar caminatas por el cerro, podemos ir con un grupo de amigos si así lo desea. ',2,NULL,1,'resources/user/user_581/services/img581-358.jpg',12,581,1,'2017-03-27 22:37:20','2017-03-27 22:47:13'),(359,'Clases de baile.','No soy un bailarín profesional, pero amo hacerlo. Así que puedo dar clases de baile básico, salsa, merengue, reggaeton, vallenato, bachata, cumbia y un poco de kizomba.',2,0,1,'resources/user/user_581/services/img581-359.jpg',12,581,1,'2017-03-27 22:41:19','2017-03-27 22:41:19'),(360,'Asesoría en investigación en Ciencias Sociales.','Soy psicólogo de la Nacho y actualmente estoy estudiando una Maestría en Psicología Clínica e Investigación en Ciencias Sociales. Si usted necesita una ayuda o asesoría con su tesis, yo estoy disponible. O si quiere saber algo de epistemología, igual',1,0,1,'resources/user/user_581/services/img581-360.jpg',10,581,1,'2017-03-27 22:44:13','2017-03-27 22:44:14'),(361,'Teatro o radio.','No soy un experto, pero a través del trabajo de campo en investigación social. He tenido acercamiento a la radio popular y el teatro del oprimido, si le interesan estas temáticas... puedo estar a su servicio. ',1,NULL,1,'resources/user/user_581/services/img581-361.png',5,581,1,'2017-03-27 22:46:35','2017-03-27 22:48:52'),(362,'Retrato fotográfico','Ofrezco una sesión de fotos de la que saldrá al menos un bello retrato. Sería en un lugar exterior o si tienes un estudio de fotografía. Mi portafolio está en instagram.com/alejandrosp36 ',2,NULL,1,'resources/user/user_586/services/img586-362.jpg',5,586,1,'2017-03-28 00:41:40','2017-03-28 08:04:50'),(363,'Clase de desarrollo web','Ofrezo clases virtuales o presenciales de desarrollo web, podríamos acordar la hora. \r\n\r\nManejo desde lo básico(html,css,js), hasta lo avanzado (react,angular,etc..)',2,1,1,'resources/services/tecnologia01.jpg',11,588,1,'2017-03-28 01:14:02','2017-03-28 01:14:02'),(364,'Asesoría en Matemáticas Básicas','Ofrezco clases de Matemáticas Básicas para estudiantes de primeros semestres de universidad y de bachillerato. También puedo dictar asesorías en C++ y Java.\r\nLas asesorías pueden ser dentro del Campus, o en el lugar que acordemos.',2,1,1,'resources/user/user_589/services/img589-364.jpg',10,589,1,'2017-03-28 02:14:46','2017-03-28 05:07:00'),(365,'Clase de medicina','Ofrezco una hora de clase de medicina, principalmente temas de anatomía, fisiología, patologia, electrocardiograma y otros. El tema que deseen puede prepararse con tiempo de forma virtual.',1,1,0,'resources/services/ciencia01.jpg',10,593,1,'2017-03-28 04:02:44','2017-03-28 04:02:44'),(366,'Tejido en macramé','¿Alguna vez has querido regalar algo original, personalizado o con valor sentimental? El tejido en macramé te ofrece la posibilidad de hacer manillas, collares, aretes, cuadros, bufandas y mucho más. Ven y aprende este bello arte de bajo costo.',1,0,1,'resources/user/user_59/services/img59-366.jpg',5,59,1,'2017-03-28 04:37:37','2017-03-28 04:37:37'),(367,'Clase de análisis de imagen','Ofrezco clases de análisis de imagen con énfasis en la preparación al exámen de admisión a la Universidad Nacional de forma virtual con ejercicios básicos y complejos para entender el tipo de preguntas en esta área.',1,1,0,'resources/services/otros01.jpg',14,593,1,'2017-03-28 04:39:35','2017-03-28 04:39:35'),(368,'Practicas de Inglés','¿Te gusta el Inglés? ¿No encuentras espacios para practicarlo? Podemos practicar Inglés tomándonos un buen café o cerveza. Si te interesa, escríbeme.',1,0,1,'resources/services/idiomas01.jpg',2,596,1,'2017-03-28 04:45:34','2017-03-28 04:45:34'),(369,'Clase de tejido básico de manillas en macramé','Ofrezco dos horas de clase en tejido básico de manillas en macramé. \r\nPuedo los fines de semana o los martes. \r\nPodemos acordar un sitio de encuentro en Chapinero :)',2,0,1,'resources/services/arte01.jpg',5,597,1,'2017-03-28 05:18:04','2017-03-28 05:18:04'),(370,'Clases de astronomía','Para quienes les guste o necesiten saber sobre los hermosos objetos que tenemos en el cielo y los misterios que esconden, les ofrezco mi conocimiento sobre ellos. ¡¡¡ Será un viaje maravilloso !!!',2,0,1,'resources/user/user_599/services/img599-370.jpg',10,599,1,'2017-03-28 06:01:00','2017-03-28 06:01:00'),(371,'Clases de cocina','Ofrezco clases de cocina enfocadas en postres. También soy una maestra de.la cocina en el microondas',2,1,0,'resources/services/cocina01.jpg',1,601,1,'2017-03-28 06:20:53','2017-03-28 06:20:53'),(372,'Asesorías en materias de Medicina Veterinaria','Ofrezco asesorías en diversas materias de la carrera: patología, patología clínica, medicina interna, cirugía y medicina de animales silvestres.',2,1,1,'resources/services/otros01.jpg',14,601,1,'2017-03-28 06:24:15','2017-04-25 20:04:13'),(373,'Ciclo de diseño','Ofrezco una hora de clase de Metodología de Diseño para principiantes. Podemos realizar la sesión en el campus de la UN los días miércoles de 1:00 pm a 2:00 pm.',2,0,1,'resources/user/user_602/services/img602-373.jpg',4,602,1,'2017-03-28 07:37:29','2017-03-28 07:37:29'),(374,'Clases de inglés ','Asesorías de inglés a estudiantes de colegio y estudiantes universitarios. El punto de encuentro puede ser la Universidad Nacional',2,0,1,'resources/services/idiomas01.jpg',2,603,1,'2017-03-28 07:39:34','2017-03-28 07:39:34'),(375,'Como encontrar una foto?','Algunos concejos prácticos que utilizo para encontrar fotos que