adable , Lugar: UN',1,NULL,1,'resources/user/user_167/services/img167-444.png',12,167,1,'2017-04-22 21:01:35','2017-04-22 21:03:40'),(445,'Táctica y estrategia de Ajedrez','Ofrezco una hora de adiestramiento en la táctica y estrategia del ajedrez.',1,1,0,'resources/user/user_629/services/img629-445.gif',12,629,1,'2017-04-22 23:36:20','2017-04-22 23:36:20'),(446,'Tareas de alemán o inglés','Ofrezco ayuda para redactar o corregir tareas en las asignaturas de alemán o inglés ',1,0,1,'resources/user/user_358/services/img358-446.jpg',2,358,1,'2017-04-23 03:51:50','2017-04-23 03:51:50'),(447,'Alineacion de Chakras a traves del Reiki','Ofrezco una terapia de alineación de Chakras  a través del Reiki con péndulo y gemas. Podemos acordar un lugar de encuentro cercano al campus de la Universidad Nacional. Puedo realizar la terapia los viernes de 11am a 4 pm.',1,NULL,1,'resources/user/user_657/services/img657-447.jpg',14,657,1,'2017-04-23 22:54:49','2017-04-23 23:08:11'),(448,'Educacion nutricional','Ofrezco 2 horas de clase de fundamentos de educación nutricional. Podemos acordar un lugar de encuentro cercano al campus de la Universidad Nacional, tengo disponibilidad los viernes de 11am a 4pm. ',2,NULL,1,'resources/user/user_657/services/img657-448.jpg',1,657,1,'2017-04-23 23:07:48','2017-04-23 23:08:40'),(449,'Sesión de Juegos de Mesa','¿Cansado de Monopoly y Risk? Existen muchos juegos de mesa mas allá estos dos. Ofrezco una lista de juegos para jugar hasta cuatro jugadores para organizar una sesión de juegos.',1,NULL,1,'resources/services/entretenimiento01.jpg',6,413,1,'2017-04-24 02:08:03','2017-04-24 02:09:42'),(450,'Asesorías en Ecoturismo y Biodiversidad','Oferzco asesorías en temas ambientales. En particular Estrategias de ecoturismo, avistamiento de aves (birding) y en temas de biodiversidad',1,1,1,'resources/services/ciencia01.jpg',10,330,1,'2017-04-25 03:36:06','2017-04-25 03:36:06'),(451,'Asesoría en planes de emergencias y desastres','Ofrezco asesoría y apoyo en la elaboración de planes, programas, proyectos o sistemas de gestión del riesgo en emergencias y desastres, salud ocupacional, gestión socioambiental',1,1,1,'resources/services/otros01.jpg',14,701,1,'2017-04-26 07:37:46','2017-04-26 07:37:46'),(452,'Clases de Autodesk Revit Arquitectura','Ofrezco una hora para enseñar conceptos básicos e intermedios sobre el manejo del programa de modelación 3D, Autodesk Revit Arquitectura. El día y hora de las clases pueden acordarse en el campus UNAL.\r\n\r\n',1,NULL,1,'resources/user/user_38/services/img38-452.jpg',4,38,1,'2017-04-26 09:02:34','2017-04-26 09:23:35'),(453,'Clase de Kickboxing','Ofrezco dos horas de clase de kickboxing: acondicionamiento, técnica y sparring.',2,0,1,'resources/user/user_703/services/img703-453.jpg',12,703,1,'2017-04-27 02:34:45','2017-04-27 02:34:45'),(454,'Diseño gráfico','Ofrezco horas de trabajo en diseño de todo tipo de piezas publicitarias para eventos y otras publicaciones: flyers, afiches, tarjetas, cartillas, boletines, revistas, etc.',1,1,0,'resources/services/diseño01.jpg',4,76,1,'2017-04-28 18:29:18','2017-04-28 18:29:18'),(455,'Guía turístico ','Tengo 20 años viajando en moto dentro y fuera del país, más de un millón de kilómetros recorridos y últimamente estoy organizando moto viajes, tanto en motocicleta como en automóvil, estoy a disposición de la comunidad local y extranjera.  ',4,0,1,'resources/user/user_709/services/img709-455.jpg',14,709,1,'2017-04-28 21:40:38','2017-04-28 21:40:38'),(456,'Clase alemán ','Ofrezco una hora conversaciones en alemán, paa prepararse para diferentes exámenes obsinplememte por interés, Vivi por espacio de 6 años en alemania(Hannover, Berlin ,Kiel) y tengo buen dominio del idioma alemán ',1,1,1,'resources/services/idiomas01.jpg',2,712,1,'2017-04-28 22:59:30','2017-04-28 22:59:30'),(457,'Por el momento no ofrezco nada','Me parece estupenda la idea y aunque puedo ofrecer mis conocimientos en varios campos, por el momento solo quiero saber más de la plataforma.',4,1,0,'resources/services/otros01.jpg',14,713,1,'2017-04-29 01:23:07','2017-04-29 01:23:07'),(458,'Tipografía, Caligrafía & Lettering','Ofrezco una hora de clase de Tipografía, Caligrafía & Lettering, horario dependiendo el interés y tiempo de ambas partes.',2,1,1,'resources/user/user_714/services/img714-458.JPG',4,714,1,'2017-04-29 05:39:04','2017-04-29 05:39:04'),(459,'Clase de Música','Puedo enseñar a tocar piano o guitarra o música en general a cambio de practicar Portugués.',1,1,1,'resources/services/musica01.jpg',3,717,1,'2017-04-29 20:54:27','2017-04-29 20:54:27'),(460,'Clases','ofrezco una hora de clase de impresión 3D, puedo los sábados en la tarde de 2-5 pm, el lugar lo podemos acordar.',1,0,1,'resources/services/tecnologia01.jpg',11,718,1,'2017-04-30 01:47:39','2017-04-30 01:47:39'),(461,'Clases de Protugués','Puede ser una clase estructurada o algo más conversacional de acuerdo a los intereses. Sesiones de una o dos horas, hacia finales de la tarde o los sábados.',2,1,1,'resources/services/idiomas01.jpg',2,253,1,'2017-04-30 06:26:13','2017-04-30 06:26:13'),(462,'Asesoría en Planeación de eventos','Tengo amplia experiencia en planeación y realización de eventos, ofrezco 1 hora para asesorar sobre la programación de tu evento.',1,0,1,'resources/user/user_721/services/img721-462.jpg',6,721,1,'2017-05-02 21:35:52','2017-05-02 21:35:52'),(463,'Clases de filosofía','Ofresco dos horas de clase de filosofía. Desde su historia hasta por autores. \r\n\r\nSi quieres ver un autor o una corriente en general házmelo saber antes. Así acordamos el lugar y la fecha. Además, organizar la clase y la bibliografía.',2,1,1,'resources/services/literatura01.jpg',9,723,1,'2017-05-03 03:57:38','2017-05-03 03:57:38');
