INSERT INTO `user_scores` VALUES (1,3,5,4,'Muchas gracias todo salio muy bien.','2017-03-22 00:32:52','2017-03-22 00:32:52'),(2,5,3,4,'Buena experiencia.','2017-03-22 00:33:53','2017-03-22 00:33:53'),(3,20,3,3,'Todo salio muy bien ojala podamos tener espacio para una siguiente sesión. ','2017-03-22 07:45:28','2017-03-22 07:45:28'),(4,3,20,4,'Todo salio muy bien y aprendí mucho, Gracias','2017-03-22 07:46:39','2017-03-22 07:46:39'),(5,2,12,4,'Buen servicio ','2017-03-22 19:11:54','2017-03-22 19:11:54'),(6,12,2,0,NULL,'2017-03-22 19:12:26','2017-03-22 19:12:26'),(7,5,445,4,'Buen servicio, aprendi mucho','2017-03-24 03:20:35','2017-03-24 03:20:35'),(8,445,5,5,'asasdasdasdasdaasdadasd ','2017-03-24 03:43:49','2017-03-24 03:43:49'),(9,445,5,5,'sasdasdasdasda sdas das das dsd','2017-03-24 03:50:43','2017-03-24 03:50:43'),(10,445,5,5,' gdfzd  cvzddf','2017-03-24 03:57:09','2017-03-24 03:57:09'),(11,5,445,3,'Buen juego','2017-03-24 03:59:12','2017-03-24 03:59:12'),(12,6,3,5,'Super clase!','2017-03-24 21:45:29','2017-03-24 21:45:29'),(13,3,6,4,'El servicio fue muy bueno, Gracias.','2017-03-24 21:46:22','2017-03-24 21:46:22'),(14,558,21,5,'Me encanto el trato con Juan!! Me contó su historia  alrededor del gusto de los alfajores y su interés en aprender sobre como hacerlos. \n100% recomendado. ','2017-03-29 00:45:39','2017-03-29 00:45:39'),(15,21,558,5,'Bibiana es la mejor cocinera de alfajores que he conocido!!! Su casa es muy bonita y el trato fue espectacular. Espero volver a intercambiar algún servicio con ella. ','2017-03-29 00:47:35','2017-03-29 00:47:35'),(16,5,59,4,'Muchas gracias muy chévere','2017-03-31 06:29:26','2017-03-31 06:29:26'),(17,59,5,5,'Muy buena la clase, muchas gracias','2017-03-31 22:15:44','2017-03-31 22:15:44'),(18,351,558,5,'Muy amable y agradable Bibiana. ','2017-03-31 22:26:40','2017-03-31 22:26:40'),(19,558,351,5,'Lo mejor! Jorge Camilo sabe explicar muy bien, es una persona amable y buena gente y lo mejor... explica de manera muy fácil los conceptos.\r\nGracias!','2017-03-31 22:43:10','2017-03-31 22:43:10'),(20,361,525,5,'La experiencia fue enriquecedora porque permitió intercambiar puntos de vista, descubrimientos y posibilidades alrededor de la enseñanza de la lectura. Lo mejor:  la disposición, atención y alegría. ','2017-04-04 00:41:16','2017-04-04 00:41:16'),(21,59,499,5,'Muy buena docente, sabe orientar la clase, muy recomendada.','2017-04-04 06:56:29','2017-04-04 06:56:29'),(22,380,602,5,'Estuvo bien.','2017-04-06 00:50:55','2017-04-06 00:50:55'),(23,21,558,5,'Bibiana es una mujer muy receptiva a nuevas experiencias de aprendizaje. Me contó que realizaba alfajores por lo que estoy muy interesado en tomarlo. ','2017-04-10 23:37:18','2017-04-10 23:37:18'),(24,558,21,5,'Lo máximo!\r\nJuan explica de forma muy clara y sencilla. Además es super buena onda.\r\nMuy puntual y buena gente.\r\nCreo que solicitaré mas clases, vimos lo básico pero quedé antojada de aprender mas.','2017-04-10 23:37:37','2017-04-10 23:37:37'),(25,653,558,5,'Excelente! Esa es la palabra!','2017-04-12 22:29:22','2017-04-12 22:29:22'),(26,558,653,5,'Pasamos un buen rato y nos quedaron deliciosos los alfajores!','2017-04-12 23:34:22','2017-04-12 23:34:22'),(27,545,399,5,'Mafe tiene una muy buena actitud. Me gustó, me sentí muy comoda.\r\n\r\nMuito obrigada!  \r\n\r\nAté a próxima. :)','2017-04-20 02:22:38','2017-04-20 02:22:38'),(28,399,545,5,'Las clases virtuales son difíciles porque la interacción no es la misma que presencialmente, pero creo que aún así salió todo bien! Espero repetir :)','2017-04-20 12:03:52','2017-04-20 12:03:52'),(29,391,379,5,'Muy bien. Aprendí mucho muchas gracias.','2017-04-21 02:43:11','2017-04-21 02:43:11'),(30,413,59,5,'Se cumplió lo acordado, superando las expectativas. El tema es muy interesante. ','2017-04-22 06:07:21','2017-04-22 06:07:21'),(31,21,59,5,'El primer encuentro con Leonardo fue más que emocionante. Desde la historia de los Jardines verticales hasta ya tener tareas para crear el nuestro!! Pronto Verán nuestro Jardín.','2017-04-22 10:16:49','2017-04-22 10:16:49'),(32,59,456,5,'Persona atenta, puntual y proactiva ','2017-04-24 00:38:24','2017-04-24 00:38:24'),(33,59,413,5,'Persona atenta, puntual y proactiva ','2017-04-24 00:39:04','2017-04-24 00:39:04'),(34,59,296,5,'Persona atenta, puntual y proactiva ','2017-04-24 00:40:00','2017-04-24 00:40:00'),(35,59,21,5,'Persona atenta, puntual y proactiva ','2017-04-24 00:41:03','2017-04-24 00:41:03'),(36,59,577,5,'Persona atenta, puntual y proactiva ','2017-04-24 00:41:58','2017-04-24 00:41:58'),(37,413,277,0,NULL,'2017-04-25 18:09:04','2017-04-25 18:09:04'),(38,586,3,5,'Fue genial, y me gustó mucho el resultado :D','2017-04-26 22:30:33','2017-04-26 22:30:33'),(39,586,21,5,'Lo recomendaría como modelo jaja','2017-04-26 22:32:07','2017-04-26 22:32:07'),(40,3,586,5,'Excelente fotógrafo','2017-04-26 22:32:32','2017-04-26 22:32:32');
